INSERT INTO `example` VALUES ('1', '计算器', '简单工厂模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication1\r\n{\r\n    public class Operation {\r\n        private double _numberA = 0;\r\n        private double _numberB = 0;\r\n        public double NumberA {\r\n            get { return _numberA; }\r\n            set { _numberA = value; }\r\n        }\r\n        public double NumberB {\r\n            get { return _numberB; }\r\n            set { _numberB = value; }\r\n        }\r\n        public virtual double GetResult() {\r\n            double result = 0;\r\n            return result;\r\n            //Console.WriteLine(result);\r\n        }\r\n    }\r\n    class OperationAdd : Operation {\r\n        public override double GetResult()\r\n        {\r\n            double result = 0;\r\n            result = NumberA + NumberB;\r\n            return result;\r\n        }\r\n    }\r\n    class OperationSub : Operation {\r\n        public override double GetResult()\r\n        {\r\n            double result = 0;\r\n            result = NumberA - NumberB;\r\n            return result;\r\n        }\r\n    }\r\n    class OperationMul : Operation {\r\n        public override double GetResult()\r\n        {\r\n            double result = 0;\r\n            result = NumberA * NumberB;\r\n            return result;\r\n        }\r\n    }\r\n    class OperationDiv : Operation {\r\n        public override double GetResult()\r\n        {\r\n            double result = 0;\r\n            result = NumberA / NumberB;\r\n            return result;\r\n        }\r\n    }\r\n    public class OperationFactory {\r\n        public static Operation createOperate(string operate) {\r\n            Operation oper = null;\r\n            switch (operate) { \r\n                case \"+\":\r\n                    oper = new OperationAdd();\r\n                    break;\r\n                case \"-\":\r\n                    oper = new OperationSub();\r\n                    break;\r\n                case \"*\":\r\n                    oper = new OperationMul();\r\n                    break;\r\n                case \"/\":\r\n                    oper = new OperationDiv();\r\n                    break;\r\n            }\r\n            return oper;\r\n        }\r\n    }\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Operation oper;\r\n            oper = OperationFactory.createOperate(\"+\");\r\n            oper.NumberA = 1;\r\n            oper.NumberB = 2;\r\n            double result = oper.GetResult();\r\n            Console.Read();\r\n        }\r\n    }\r\n    \r\n}\r\n');
INSERT INTO `example` VALUES ('2', '策略模式', '策略模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Context context;\r\n            context = new Context(new ConcreteStrategyA());\r\n            context.ContextInterface();\r\n            context = new Context(new ConcreteStrategyB());\r\n            context.ContextInterface();\r\n            context = new Context(new ConcreteStrategyC());\r\n            context.ContextInterface();\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class Strategy {\r\n        public abstract void AlgorithmInterface();\r\n    }\r\n    class ConcreteStrategyA : Strategy {\r\n        public override void AlgorithmInterface()\r\n        {\r\n            Console.WriteLine(\"算法A的实现\");\r\n        }\r\n    }\r\n    class ConcreteStrategyB : Strategy\r\n    {\r\n        public override void AlgorithmInterface()\r\n        {\r\n            Console.WriteLine(\"算法B的实现\");\r\n        }\r\n    }\r\n    class ConcreteStrategyC : Strategy\r\n    {\r\n        public override void AlgorithmInterface()\r\n        {\r\n            Console.WriteLine(\"算法C的实现\");\r\n        }\r\n    }\r\n    class Context {\r\n        Strategy strategy;\r\n        public Context(Strategy strategy) {\r\n            this.strategy = strategy;\r\n        }\r\n        public void ContextInterface() {\r\n            strategy.AlgorithmInterface();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('3', '商场促销', '策略模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.ComponentModel;\r\nusing System.Data;\r\nusing System.Drawing;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Windows.Forms;\r\n\r\nnamespace WindowsFormsApplication1\r\n{\r\n    public partial class Form1 : Form\r\n    {\r\n        public Form1()\r\n        {\r\n            InitializeComponent();\r\n        }\r\n        double total=0.0d;  //总价\r\n        private void button1_Click(object sender, EventArgs e)\r\n        {\r\n             CashContext cc=null;\r\n            string str=comboBox1.SelectedItem.ToString();\r\n                switch(str){\r\n                    case\"正常收费\":\r\n                        cc=new CashContext(new CashNormal());\r\n                        break;\r\n                    case \"满300返100\":\r\n                        cc=new CashContext(new CashReturn(\"300\",\"100\"));\r\n                        break;\r\n                    case \"打8折\":\r\n                        cc=new CashContext(new CashRebate(\"0.8\"));\r\n                        break;\r\n                }\r\n                double totalPrices=0d;\r\n                totalPrices=cc.GetResult(Convert.ToDouble(textBox1.Text)*Convert.ToDouble(textBox2.Text));\r\n                total=total+totalPrices;\r\n                listBox1.Items.Add(\"单价：\"+textBox1.Text+\"数量：\"+textBox2.Text+\" \"+listBox1.SelectedItem+\"合计：\"+ total.ToString());\r\n                listBox1.Text=total.ToString();\r\n            }\r\n        }\r\n        }\r\n    abstract class CashSuper\r\n    {  //现金收取超类的抽象方法，收取现金，参数为原价，返回为当前价\r\n        public abstract double acceptCash(double money);\r\n    }\r\n    class CashNormal : CashSuper\r\n    {  //正常收费，原价返回\r\n        public override double acceptCash(double money)\r\n        {\r\n            return money;\r\n        }\r\n    }\r\n    class CashRebate : CashSuper\r\n    {\r\n        public double moneyRebate = 1d;\r\n        public CashRebate(string moneyRebate)\r\n        {  //打折收费，初始化时，必须要输入折扣率，如八折，就是0.8\r\n            this.moneyRebate = double.Parse(moneyRebate);\r\n        }\r\n        public override double acceptCash(double money)\r\n        {\r\n            return money * moneyRebate;\r\n        }\r\n    }\r\n    class CashReturn : CashSuper\r\n    {\r\n        private double moneyCondition = 0.0d;\r\n        private double moneyReturn = 0.0d;\r\n        public CashReturn(string moneyCondition, string moneyReturn)\r\n        {  //返利收费，初始化时必须输入返利条件和返利值，比如满300返100，则moneyCondition为300，moneyReturn为100；\r\n            this.moneyCondition = double.Parse(moneyCondition);\r\n            this.moneyReturn = double.Parse(moneyReturn);\r\n        }\r\n        public override double acceptCash(double money)\r\n        {\r\n            double result = money;\r\n            if (money >= moneyCondition)\r\n                result = money - Math.Floor(money / moneyCondition) * moneyReturn;  //若大于返利条件，则需要减去返利值\r\n            return result;\r\n        }\r\n    }\r\n    class CashContext\r\n    {\r\n        private CashSuper cs;  //声明一个CashSuper对象\r\n        public CashContext(CashSuper csuper)\r\n        { //通过构造方法，传入具体的收费策略；\r\n            this.cs = csuper;\r\n        }\r\n        public double GetResult(double money)\r\n        {\r\n            return cs.acceptCash(money);\r\n        }\r\n    }\r\n\r\n');
INSERT INTO `example` VALUES ('4', '写日志', '策略模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Reflection;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n	    LogContext log = new LogContext();\r\n	    log.log(\"记录日志\");\r\n	    log.log(\"再次记录日志\");\r\n	    Console.Read();\r\n	}\r\n    }\r\n    public interface LogStrategy{\r\n	void log(String msg);\r\n    }\r\n    public class DbLog:LogStrategy{\r\n		public void log(String msg) {\r\n		if(msg!=null &&msg.Trim().Length>5){\r\n		Console.WriteLine(\"出错啦！\");\r\n		}\r\n		Console.WriteLine(\"现在把\'\"+msg+\"\'记录到数据库中\");\r\n	    }\r\n    }\r\n    public class FileLog:LogStrategy{\r\n 	public void log(String msg){\r\n		Console.WriteLine(\"现在把\'\"+msg+\"\'记录到文件中\");\r\n	}\r\n    }\r\n    public class LogContext\r\n    {\r\n	public void log(String msg)\r\n	{\r\n	    LogStrategy strategy = new DbLog();\r\n	    try\r\n            {\r\n                strategy.log(msg);\r\n            }\r\n            catch (Exception err)\r\n            {\r\n                strategy = new FileLog();\r\n                strategy.log(msg);\r\n            }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('5', '装饰模式', '装饰模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            ConcreteComponent c=new ConcreteComponent();\r\n            ConcreteDecoratorA d1=new ConcreteDecoratorA();\r\n            ConcreteDecoratorB d2=new ConcreteDecoratorB();\r\n            d1.SetComponent(c);\r\n            d2.SetComponent(d1);\r\n            d2.Operation();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //Component类\r\n    abstract class Component {\r\n        public abstract void Operation();\r\n    }\r\n    //ConcreteComponent类\r\n    class ConcreteComponent : Component {\r\n        public override void Operation()\r\n        {\r\n            Console.WriteLine(\"具体对象的操作\");\r\n        }\r\n    }\r\n    //Decorator类\r\n    abstract class Decorator : Component {\r\n        protected Component component;\r\n        public void SetComponent(Component component) {\r\n            this.component = component;\r\n        }\r\n        public override void Operation()\r\n        {\r\n            if (component != null) {\r\n                component.Operation();\r\n            }\r\n        }\r\n    }\r\n    //ConcreteDecorator类\r\n    class ConcreteDecoratorA : Decorator {\r\n        private string addedState;//本类独有的功能，以区别于ConcreteDecoratorB\r\n        public override void Operation()\r\n        {\r\n            base.Operation();//首先运行原Component的Operation()，在执行本类的功能，如addState，相当于对原Component进行了装饰\r\n            addedState = \"New State\";\r\n            Console.WriteLine(\"具体装饰对象A的操作\");\r\n        }\r\n    }\r\n    class ConcreteDecoratorB : Decorator\r\n    {\r\n        public override void Operation()\r\n        {\r\n            base.Operation();//首先运行原Component的Operation()，在执行本类的功能，如AddedBehavior，相当于对原Component进行了装饰\r\n            AddedBehavior();\r\n            Console.WriteLine(\"具体装饰对象A的操作\");\r\n        }\r\n    }\r\n    private void AddedBehavior(){\r\n    //本类独有的方法，以区别于ConcreteDecoratorA\r\n}\r\n}\r\n');
INSERT INTO `example` VALUES ('7', '小菜扮靓', '装饰模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Person xc = new Person(\"小菜\");\r\n            Console.WriteLine(\"\\n第一种装扮：\");\r\n            Sneakers pqx = new Sneakers();\r\n            BigTrouser kk = new BigTrouser();\r\n            TShirts dtx = new TShirts();\r\n            pqx.Decorate(xc);\r\n            kk.Decorate(pqx);\r\n            dtx.Decorate(kk);\r\n            dtx.Show();\r\n            Console.WriteLine(\"\\n第二种装扮：\");\r\n            LeatherShoes px = new LeatherShoes();\r\n            Tie ld = new Tie();\r\n            Suit xz = new Suit();\r\n            px.Decorate(xc);\r\n            ld.Decorate(px);\r\n            xz.Decorate(ld);\r\n            xz.Show();\r\n            Console.Read();\r\n        }\r\n    }\r\n    class Person\r\n    {\r\n        public Person() { }\r\n        private string name;\r\n        public Person(string name)\r\n        {\r\n            this.name = name;\r\n        }\r\n        public virtual void Show()\r\n        {\r\n            Console.WriteLine(\"装扮的{0}\", name);\r\n        }\r\n    }\r\n    class Finery : Person\r\n    {\r\n        protected Person component;\r\n        //打扮\r\n        public void Decorate(Person component)\r\n        {\r\n            this.component = component;\r\n        }\r\n        public override void Show()\r\n        {\r\n            if (component != null)\r\n            {\r\n                component.Show();\r\n            }\r\n        }\r\n    }\r\n    class TShirts : Finery\r\n    {\r\n        public override void Show()\r\n        {\r\n            Console.Write(\"大T恤\");\r\n            base.Show();\r\n        }\r\n    }\r\n    class BigTrouser : Finery\r\n    {\r\n        public override void Show()\r\n        {\r\n            Console.Write(\"垮裤\");\r\n            base.Show();\r\n        }\r\n    }\r\n    class Sneakers : Finery\r\n    {\r\n        public override void Show()\r\n        {\r\n            Console.Write(\"破球鞋\");\r\n            base.Show();\r\n        }\r\n    }\r\n    class Suit : Finery\r\n    {\r\n        public override void Show()\r\n        {\r\n            Console.Write(\"西装\");\r\n            base.Show();\r\n        }\r\n    }\r\n    class Tie : Finery\r\n    {\r\n        public override void Show()\r\n        {\r\n            Console.Write(\"领带\");\r\n            base.Show();\r\n        }\r\n    }\r\n    class LeatherShoes : Finery\r\n    {\r\n        public override void Show()\r\n        {\r\n            Console.Write(\"皮鞋\");\r\n            base.Show();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('8', 'JAVA中的I/O流', '装饰模式', 'public class iotEST {\r\n\r	public static void main(String[] args) throws Exception {\r				DataInputStream din=null;\r\n		try\r{\r\n			din=new DataInputStream(\rnew BufferedInputStream(new FileInputStream(\"IOTest.txt\")\r)\r);\r\n			byte bs[]=new byte[din.available()];\r							din.read(bs);\r\n			String content=new String(bs);\r								System.out.println(\"文件内容===\"+content);\r\n\r		}finally{\r\n			din.close();\r\n		}\r\n	}\r\npublic class EncryptOutputStream extends OutputStream{\r\n        private OutputStream os=null;\r\n\r	public EncryptOutputStream（OutputStream os){\r\n\r		this.os=os;\r\n	}\r\n\r	public void write(int a) throws IOException{\r\n		a=a+2;\r\n		if(a>=(97+26)){\r\n\r			a=a-26;\r\n		}\r\n		this.os.write(a);\r\n	}\r\n}\r\n public class iotEST{\r\n	public static void main(String[] args) throws Exception{\r\n		DataOutputStream dout=new DataOutputStream(\rnew BufferedOutputStream(\r new EncryptOutputStream(\rnew FileOutputStream(\"IOTest.txt\"))));\r\n		dout.write(\"abcdxyz\".getBytes());\r\n		dout.close();\r\n\r	}\r\n\r}');
INSERT INTO `example` VALUES ('9', '代理模式', '代理模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Proxy proxy = new Proxy();\r\n            proxy.Request();\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class Subject {\r\n        public abstract void Request();\r\n    }\r\n    class RealSubject : Subject {\r\n        public override void Request()\r\n        {\r\n            Console.WriteLine(\"真实的请求\");\r\n        }\r\n    }\r\n    class Proxy : Subject {\r\n        RealSubject realSubject;\r\n        public override void Request()\r\n        {\r\n            if (realSubject == null) {\r\n                realSubject = new RealSubject();\r\n            }\r\n            realSubject.Request();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('10', '为别人做嫁衣', '代理模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication1\r\n{\r\n    interface IGiveGift{\r\n    void GiveDolls();\r\n    void GiveFlowers();\r\n    void GiveChocolate();\r\n    }\r\n  \r\n    class SchoolGirl {\r\n        private string name;\r\n        public string Name {\r\n            get { return name; }\r\n            set { name = value; }\r\n        }\r\n    }\r\n    class Pursuit:IGiveGift {\r\n        SchoolGirl mm;\r\n        public Pursuit(SchoolGirl mm) {\r\n            this.mm = mm;\r\n        }\r\n        public void GiveDolls() {\r\n            Console.WriteLine(mm.Name + \"送你鲜花\");\r\n        }\r\n        public void GiveFlowers() {\r\n            Console.WriteLine(mm.Name+\"送你洋娃娃\");\r\n        }\r\n        public void GiveChocolate() {\r\n            Console.WriteLine(mm.Name+\"送你巧克力\");\r\n        }\r\n    }\r\n    class Proxy : IGiveGift {\r\n        Pursuit gg;\r\n        public Proxy(SchoolGirl mm) {\r\n            gg = new Pursuit(mm);\r\n        }\r\n        public void GiveDolls() {\r\n            gg.GiveDolls();\r\n        }\r\n        public void GiveFlowers() {\r\n            gg.GiveFlowers();\r\n        }\r\n        public void GiveChocolate() {\r\n            gg.GiveChocolate();\r\n        }\r\n    }\r\n      class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            SchoolGirl jiaojiao = new SchoolGirl();\r\n            jiaojiao.Name = \"李娇娇\";\r\n            Proxy daili = new Proxy(jiaojiao);\r\n            daili.GiveDolls();\r\n            daili.GiveFlowers();\r\n            daili.GiveChocolate();\r\n            Console.Read();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('11', '订单系统', '代理模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n		OrderApi order=new OrderProxy(new Order(\"设计模式\",100,\"张三\"));\r			order.setOrderNum(123, \"李四\");\r\n		Console.WriteLine(\"李四修改后订单记录没有变化：\"+order);\r		       		order.setOrderNum(123, \"张三\");\r		                		Console.WriteLine(\"张三修改后，订单记录：\"+order);\r\n		Console.Read();\r\n	}\r\n    }\r\n    interface OrderApi\r\n    {\r\n         string getProductName();\r\n         void setProductName(string productName, string user);\r\n         int getOrderNum();\r\n         void setOrderNum(int orderNum, string user);\r\n         string getOrderUser();\r\n         void setOrderUser(string orderUser, string user);\r\n\r\n    }\r\n    public class Order : OrderApi\r\n    {\r\n        private string productName;\r\n        private int orderNum;\r\n        private string orderUser;\r\n        public Order(string productName, int orderNum, string orderUser)\r\n        {\r\n            this.productName = productName;\r\n            this.orderNum = orderNum;\r\n            this.orderUser = orderUser;\r\n        }\r\n        public int getOrderNum()\r\n        {\r\n            return orderNum;\r\n\r\n        }\r\n        public string getOrderUser()\r\n        {\r\n            return orderUser;\r\n        }\r\n        public string getProductName()\r\n        {\r\n            return productName;\r\n        }\r\n        public void setOrderNum(int orderNum, string user)\r\n        {\r\n            this.orderNum = orderNum;\r\n        }\r\n        public void setOrderUser(string orderUser, string user)\r\n        {\r\n            this.orderUser = orderUser;\r\n\r\n        }\r\n        public void setProductName(string productName, string user)\r\n        {\r\n            this.productName = productName;\r\n        }\r\n    }\r\n\r    public class OrderProxy:OrderApi{	private Order order=null;\r\n\r	public OrderProxy(Order real){\r\n		this.order=real;\r\n\r	}\r\n	public int getOrderNum(){\r\n		return this.order.getOrderNum();\r\n\r	}\r\n\r\r	public string getOrderUser(){\r\n		return this.order.getOrderUser();\r\n	}\r\n	public string getProductName(){\r\n		return this.order.getProductName();\r\n	}\r\n	public void setOrderNum(int orderNum, string user){\r\n\r		if(user!=null && user.Equals(this.getOrderUser())){\r						order.setOrderNum(orderNum, user);\r\n		}else{\r\n			Console.WriteLine(\"对不起\"+user+\"，您无权修改订单中的订购数量\");	\r\n	}\r\n}\r\n    	public void setOrderUser(string orderUser, string user){\r\n		if(user!=null && user.Equals(this.getOrderUser())){\r						order.setOrderUser(orderUser, user);\r\n		}else{\r\n			Console.WriteLine(\"对不起\"+user+\"，您无权修改订单中的订购人\");\r			}\r\n	}\r\n\r\n        public void setProductName(string productName,string user){\r\n		if(user!=null && user.Equals(this.getOrderUser()){\r\n			order.setProductName(productName, user);\r\n\r		}else{\r\n			Console.WriteLine(\"对不起\"+user+\"，您无权修改订单中的产品名称\");\r\n		}\r\n}\r\n\r\n	public string toString(){\r\n        return \"ProductName=\" + this.getProductName() + \",orderNum=\"+this.getOrderNum() + \",orderUser=\" + this.getOrderUser();\r\n    }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('13', '学雷锋', '工厂方法模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            IFactory factory = new UndergraduateFactory();\r\n            LeiFeng student = factory.CreateLeiFeng();\r\n            student.Buyrice();\r\n            student.Wash();\r\n            student.Sweep();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //雷锋\r\n    class LeiFeng {\r\n        public void Sweep() {\r\n            Console.WriteLine(\"扫地\");\r\n        }\r\n        public void Wash() {\r\n            Console.WriteLine(\"洗衣\");\r\n        }\r\n        public void Buyrice() {\r\n            Console.WriteLine(\"买米\");\r\n        }\r\n    }\r\n    //学雷锋的大学生\r\n    class Undergraduate : LeiFeng { }\r\n    //社区志愿者\r\n    class Volunteer : LeiFeng { }\r\n    //简单雷锋工厂\r\n    class SimpleFactory {\r\n        public static LeiFeng CreateLeiFeng(string type) {\r\n            LeiFeng result = null;\r\n            switch (type) { \r\n                case \"学雷锋的大学生\":\r\n                    result = new Undergraduate();\r\n                    break;\r\n                case \"社区志愿者\":\r\n                    result = new Volunteer();\r\n                    break;\r\n            }\r\n            return result;\r\n        }\r\n    }\r\n    //雷锋工厂\r\n    interface IFactory {\r\n        LeiFeng CreateLeiFeng();\r\n    }\r\n    //学雷锋的大学生工厂\r\n    class UndergraduateFactory : IFactory {\r\n        public LeiFeng CreateLeiFeng() {\r\n            return new Undergraduate();\r\n        }\r\n    }\r\n    //社区志愿者工厂\r\n    class VolunteerFactory : IFactory {\r\n        public LeiFeng CreateLeiFeng() {\r\n            return new Volunteer();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('14', '导出数据', '工厂方法模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            ExportOperate operate = new ExportDBOperate();\r\n            operate.export(\"测试数据\");\r\n            Console.Read();\r\n        }\r\n    }\r\n    interface ExportFileApi\r\n    {\r\n	bool export(string data);\r\n    }\r\n    public class ExportDB:ExportFileApi{\r\n	public bool export(String data){\r\n	    Console.WriteLine(\"导出数据\"+data+\"到数据库备份文件\");\r\n	    return true;\r\n	}\r\n    }\r \r\n    public class ExportTxtFile:ExportFileApi{\r\n	public bool export(string data){\r\n	    Console.WriteLine(\"导出数据\"+data+\"到文本文件\");\r\n	    return true;\r\n	}\r\n    }\r\n    public abstract class ExportOperate\r\n    {\r\n	public bool export(string data)\r\n	{\r\n	    ExportFileApi api = factoryMethod();\r\n	    return api.export(data);\r\n 	}\r\n	protected abstract ExportFileApi factoryMethod();\r\n    }\r \r\n    public class ExportDBOperate:ExportOperate{\r\n	protected ExportFileApi factoryMethod(){\r\n	    return new ExportDB();\r\n\r	}\r\n    }\r\n\r    public class ExportTxtFileOperate:ExportOperate{\r\n	protected ExportFileApi factoryMethod(){\r\n	    return new ExportTxtFile();\r\n	}\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('15', '原型模式', '原型模式', 'abstract class Prototype{\r\n    private string id;\r\n    public Prototype(string id){\r\n        this.id = id;\r\n    }\r\n    public string Id{\r\n        get{ return id; }\r\n    }\r\n    abstract public Prototype Clone();\r\n}\r\nclass ConcretePrototype1 : Prototype{\r\n    //Constructors\r\npublic ConcretePrototype(string id ) : base(id){}\r\n       // Methods \r\n         override public Prototype Clone(){\r\n       // Shallow copy\r\n       return (Prototype)this.MemberwiseClone();\r\n    }\r\n}\r\nclass ConcretePrototype2 : Prototype{\r\n    //Constructors\r\n    public ConcretePrototype2(string id ) : base(id){}\r\n       // Methods\r\n       override public Prototype Clone(){\r\n       // Shallow copy\r\n       return (Prototype)this.MemberwiseClone();\r\n    }\r\n}\r\nclass Client{\r\n   public static void Main( string[] args ) { \r\n   // Create two instances and clone each \r\n   ConcretePrototype1 p1 = new ConcretePrototype(\"I\");\r\n        ConcretePrototype1 c1 = (ConcretePrototype1)p1.Clone();\r\n    Console.WriteLine( \"Cloned: {0}\", c1.Id );\r\n    ConcretePrototype2 p2 = new ConcretePrototype2( \"II\" );\r\n    ConcretePrototype2 c2 = (ConcretePrototype2)p2.Clone();\r\n    Console.WriteLine( \"Cloned: {0}\", c2.Id ); \r\n} \r\n}\r');
INSERT INTO `example` VALUES ('16', '简历的深复制实现', '原型模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Resume a = new Resume(\"大鸟\");\r\n            a.SetPersonalInfo(\"男\", \"29\");\r\n            a.SetWorkExperience(\"1998-2000\",\"xx公司\");\r\n            Resume b = (Resume)a.Clone();  //只需要调用Clone方法就可以实现新简历的生成，并且可以再修改新简历的细节；\r\n            b.SetWorkExperience(\"1998-2006\", \"YY公司\");\r\n            Resume c = (Resume)a.Clone();\r\n            c.SetPersonalInfo(\"男\", \"24\");\r\n            c.SetWorkExperience(\"1998-2003\", \"ZZ企业\");\r\n            a.Display();\r\n            b.Display();\r\n            c.Display();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //工作经历\r\n    class WorkExperience:ICloneable {\r\n        private string workDate;\r\n        public string WorkDate {\r\n            get { return workDate; }\r\n            set { workDate = value; }\r\n        }\r\n        private string company;\r\n        public string Company {\r\n            get { return company; }\r\n            set { company = value; }\r\n        }\r\n        public Object Clone() {\r\n            return (Object)this.MemberwiseClone();\r\n        }\r\n    }\r\n    //简历\r\n    class Resume : ICloneable {\r\n        private string name;\r\n        private string sex;\r\n        private string age;\r\n        private WorkExperience work;  //引用“工作经历”对象；\r\n        public Resume(string name) {\r\n            this.name = name;\r\n            work = new WorkExperience();  //在“简历”类实例化时同时实例化“工作经历”;\r\n        }\r\n        private Resume(WorkExperience work) {  //提供Clone方法调用的私有构造函数，以便克隆“工作经历”的数据；\r\n            this.work = (WorkExperience)work.Clone();\r\n        }\r\n        //设置个人信息\r\n        public void SetPersonalInfo(string sex, string age) {\r\n            this.sex = sex;\r\n            this.age = age;\r\n        }\r\n        //设置工作经历\r\n        public void SetWorkExperience(string workDate, string company) {\r\n            work.WorkDate = workDate; //调用此方法时，给对象的两属性赋值；\r\n            work.Company = company;\r\n        }\r\n        //显示\r\n        public void Display() {\r\n            Console.WriteLine(\"{0} {1} {2}\", name, sex, age);\r\n            Console.WriteLine(\"工作经历：{0} {1}\", work.WorkDate,work.Company);  //显示时，显示工作经历的两属性值；\r\n        }\r\n        public Object Clone() {\r\n            Resume obj = new Resume(this.work);\r\n            obj.name = this.name;\r\n            obj.sex = this.sex;\r\n            obj.age = this.age;\r\n            return obj;\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('17', '简历的原型实现', '原型模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Resume a = new Resume(\"大鸟\");\r\n            a.SetPersonalInfo(\"男\", \"29\");\r\n            a.SetWorkExperience(\"1998-2000\",\"xx公司\");\r\n            Resume b = (Resume)a.Clone();  //只需要调用Clone方法就可以实现新简历的生成，并且可以再修改新简历的细节；\r\n            b.SetWorkExperience(\"1998-2006\", \"YY公司\");\r\n            Resume c = (Resume)a.Clone();\r\n            c.SetPersonalInfo(\"男\", \"24\");\r\n            a.Display();\r\n            b.Display();\r\n            c.Display();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //简历\r\n    class Resume : ICloneable {\r\n        private string name;\r\n        private string sex;\r\n        private string age;\r\n        private string timeArea;\r\n        private string company;\r\n        public Resume(string name) {\r\n            this.name = name;\r\n        }\r\n        //设置个人信息\r\n        public void SetPersonalInfo(string sex, string age) {\r\n            this.sex = sex;\r\n            this.age = age;\r\n        }\r\n        //设置工作经历\r\n        public void SetWorkExperience(string timeArea, string company) {\r\n            this.timeArea = timeArea;\r\n            this.company = company;\r\n        }\r\n        //显示\r\n        public void Display() {\r\n            Console.WriteLine(\"{0}{1}{2}\", name, sex, age);\r\n            Console.WriteLine(\"工作经历：{0}{1}\", timeArea,company);\r\n        }\r\n        public Object Clone() {\r\n            return (Object)this.MemberwiseClone();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('18', '模板方法模式', '模板方法模式', 'abstract class AbstractClass{\r\n    //Methods\r\n    abstract public void PrimitiveOperation1();\r\n    abstract public void PrimitiveOperation2();\r\n    // The Template method\r\n     public void TemplateMethod() {\r\n         Console.WriteLine(\" \");\r\n         PrimitiveOperation1();\r\n         PrimitiveOperation2();\r\n    }\r\n}\r\n// \"ConcreteClass\" \r\nclass ConcreteClassA:AbstractClass { \r\n    // Methods\r\n    public override void PrimitiveOperation1(){ \r\n        Console.WriteLine(\"具体类A方法1实现\");\r\n    } \r\n    public override void PrimitiveOperation2() {\r\n        Console.WriteLine(\"具体类A方法2实现\"); \r\n    } \r\n} \r\nclass ConcreteClassB:AbstractClass { \r\n    // Methods\r\n    public override void PrimitiveOperation1(){ \r\n        Console.WriteLine(\"具体类B方法1实现\");\r\n    } \r\n    public override void PrimitiveOperation2() {\r\n        Console.WriteLine(\"具体类B方法2实现\"); \r\n    } \r\n} \r\npublic class Client{\r\n    public static void Main( string[] args)   { \r\n       //Create instance and call template method\r\n       AbstractClass c = new ConcreteClass();\r\n       c.TemplateMethod();\r\n   }\r\n}\r');
INSERT INTO `example` VALUES ('19', '抄试卷', '模板方法模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Console.WriteLine(\"学生甲抄的试卷：\");\r\n            TestPaper studentA = new TestPaperA();  //将子类变量的声明改成了父类，利用了多态性，实现了代码重用\r\n            studentA.TestQuestion1();\r\n            studentA.TestQuestion2();\r\n            studentA.TestQuestion3();\r\n            Console.WriteLine(\"学生乙抄的试卷：\");\r\n            TestPaper studentB = new TestPaperB();\r\n            studentB.TestQuestion1();\r\n            studentB.TestQuestion2();\r\n            studentB.TestQuestion3();\r\n            Console.Read();\r\n        }\r\n    }\r\n    class TestPaper {\r\n        public void TestQuestion1() {\r\n            Console.WriteLine(\"杨过得到，后来给了郭靖，练成倚天剑、屠龙刀的玄铁可能是【】a.球磨铸铁b.马口铁c.高速合金钢d.碳素纤维\");\r\n            Console.WriteLine(\"答案：\"+Answer1());  //虚方法\r\n        }\r\n        protected virtual string Answer1(){  //此方法的目的就是给继承的子类重写，因为这里每个人的答案都是不同的；\r\n            return \"\";\r\n        }\r\n        public void TestQuestion2() {\r\n            Console.WriteLine(\"杨过、程英、陆无双铲除了情花，造成【】a.是这种植物不在害人b.使一种珍稀物种灭绝c.破坏了那个生物圈的生态平衡d.造成该地区沙漠化\");\r\n            Console.WriteLine(\"答案：\"+Answer2());\r\n        }\r\n        protected virtual string Answer2(){\r\n            return \"\";\r\n        }\r\n        public void TestQuestion3() {\r\n            Console.WriteLine(\"蓝凤凰致使华山师徒、桃谷六仙呕吐不止，如果你是大夫，会给他们开什么药【】a.阿司匹林b.牛黄解毒片c.氟哌酸d.让他们喝大量的生牛奶e.以上全不对\");\r\n            Console.WriteLine(\"答案：\"+Answer3());\r\n        }\r\n        protected virtual string Answer3(){\r\n            return \"\";\r\n        }\r\n    }\r\n    class TestPaperA : TestPaper\r\n    {\r\n        protected override string Answer1()\r\n        {\r\n            return \"b\";\r\n        }\r\n        protected override string Answer2()\r\n        {\r\n            return \"c\";\r\n        }\r\n        protected override string Answer3()\r\n        {\r\n            return \"a\";\r\n        }\r\n    }\r\n    class TestPaperB : TestPaper {\r\n        protected override string Answer1()\r\n        {\r\n            return \"c\";\r\n        }\r\n        protected override string Answer2()\r\n        {\r\n            return \"a\";\r\n        }\r\n        protected override string Answer3()\r\n        {\r\n            return \"a\";\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('20', '外观模式', '外观模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Facade facade = new Facade();\r\n            facade.MethodA();\r\n            facade.MethodB();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //四个子系统的类\r\n    class SubSystemOne {\r\n        public void MethodOne() {\r\n            Console.WriteLine(\"子系统方法一\");\r\n        }\r\n    }\r\n    class SubSystemTwo\r\n    {\r\n        public void MethodTwo()\r\n        {\r\n            Console.WriteLine(\"子系统方法二\");\r\n        }\r\n    }\r\n    class SubSystemThree\r\n    {\r\n        public void MethodThree()\r\n        {\r\n            Console.WriteLine(\"子系统方法三\");\r\n        }\r\n    }\r\n    class SubSystemFour\r\n    {\r\n        public void MethodFour()\r\n        {\r\n            Console.WriteLine(\"子系统方法四\");\r\n        }\r\n    }\r\n    //外观类\r\n    class Facade {\r\n        SubSystemOne one;\r\n        SubSystemTwo two;\r\n        SubSystemThree three;\r\n        SubSystemFour four;\r\n        public Facade() {\r\n            one = new SubSystemOne();\r\n            two = new SubSystemTwo();\r\n            three = new SubSystemThree();\r\n            four = new SubSystemFour();\r\n        }\r\n        public void MethodA() {\r\n            Console.WriteLine(\"\\n方法组A()-----\");\r\n            one.MethodOne();\r\n            two.MethodTwo();\r\n            four.MethodFour();\r\n        }\r\n        public void MethodB() {\r\n            Console.WriteLine(\"\\n方法组B-----\");\r\n            two.MethodTwo();\r\n            three.MethodThree();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('21', '股票投资', '外观模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Fund jijin = new Fund();  //此时用户不需要了解股票，甚至可以对股票一无所知，买了基金就回家睡觉，一段时间在赎回就可以大把数钱。参与股票的具体买卖都由基金公司完成。\r\n            //基金购买\r\n            jijin.BuyFund();\r\n            //基金赎回\r\n            jijin.SellFund();\r\n            Console.Read();\r\n        }\r\n    }\r\n    class Stock1\r\n    {\r\n        //卖股票\r\n        public void Sell()\r\n        {\r\n            Console.WriteLine(\"股票1卖出\");\r\n        }\r\n        //买股票\r\n        public void Buy()\r\n        {\r\n            Console.WriteLine(\"股票1买入\");\r\n        }\r\n    }\r\n    class Stock2\r\n    {\r\n        //卖股票\r\n        public void Sell()\r\n        {\r\n            Console.WriteLine(\"股票2卖出\");\r\n        }\r\n        //买股票\r\n        public void Buy()\r\n        {\r\n            Console.WriteLine(\"股票2买入\");\r\n        }\r\n    }\r\n    class Stock3\r\n    {\r\n        //卖股票\r\n        public void Sell()\r\n        {\r\n            Console.WriteLine(\"股票3卖出\");\r\n        }\r\n        //买股票\r\n        public void Buy()\r\n        {\r\n            Console.WriteLine(\"股票3买入\");\r\n        }\r\n    }\r\n    class NationalDebt1\r\n    {\r\n        //卖国债\r\n        public void Sell()\r\n        {\r\n            Console.WriteLine(\"国债1卖出\");\r\n        }\r\n        //买国债\r\n        public void Buy()\r\n        {\r\n            Console.WriteLine(\"国债1买入\");\r\n        }\r\n    }\r\n    class Realty1\r\n    {\r\n        //卖房地产\r\n        public void Sell()\r\n        {\r\n            Console.WriteLine(\"房地产1卖出\");\r\n        }\r\n        //买房地产\r\n        public void Buy()\r\n        {\r\n            Console.WriteLine(\"房地产1买入\");\r\n        }\r\n    }\r\n    class Fund {  //基金类，它需要了解所有的股票或其他投资方式的方法或属性，进行组合，以备外界调用；\r\n        Stock1 gu1;\r\n        Stock2 gu2;\r\n        Stock3 gu3;\r\n        NationalDebt1 nd1;\r\n        Realty1 rt1;\r\n        public Fund() {\r\n            gu1 = new Stock1();\r\n            gu2 = new Stock2();\r\n            gu3 = new Stock3();\r\n            nd1 = new NationalDebt1();\r\n            rt1 = new Realty1();\r\n        }\r\n        public void BuyFund() {\r\n            gu1.Buy();\r\n            gu2.Buy();\r\n            gu3.Buy();\r\n            nd1.Buy();\r\n            rt1.Buy();\r\n        }\r\n        public void SellFund() {\r\n            gu1.Sell();\r\n            gu2.Sell();\r\n            gu3.Sell();\r\n            nd1.Sell();\r\n            rt1.Sell();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('22', '建造者模式', '建造者模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Director director = new Director();\r\n            Builder b1 = new ConcreteBuilder1();\r\n            Builder b2 = new ConcreteBuilder2();\r\n            director.Construct(b1);\r\n            Product p1 = b1.GetResult();\r\n            p1.Show();\r\n            director.Construct(b2);\r\n            Product p2 = b2.GetResult();\r\n            p2.Show();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //产品类\r\n    class Product {\r\n        IList<string> parts = new List<string>();\r\n        public void Add(string part){//添加产品部件\r\n            parts.Add(part);\r\n        }\r\n        public void Show() {\r\n            Console.WriteLine(\"\\n产品 创建-----\");\r\n            foreach (string part in parts) {\r\n                Console.WriteLine(part);\r\n            }\r\n        }\r\n    }\r\n    //抽象建造者类\r\n    abstract class Builder {\r\n        public abstract void BuildPartA();\r\n        public abstract void BuildPartB();\r\n        public abstract Product GetResult();\r\n    }\r\n    //具体建造者类1\r\n    class ConcreteBuilder1 : Builder {\r\n        private Product product = new Product();\r\n        public override void BuildPartA()\r\n        {\r\n            product.Add(\"部件A\");\r\n        }\r\n        public override void BuildPartB()\r\n        {\r\n            product.Add(\"部件B\");\r\n        }\r\n        public override Product GetResult()\r\n        {\r\n            return product;\r\n        }\r\n    }\r\n    //具体建造者类2\r\n    class ConcreteBuilder2 : Builder\r\n    {\r\n        private Product product = new Product();\r\n        public override void BuildPartA()\r\n        {\r\n            product.Add(\"部件X\");\r\n        }\r\n        public override void BuildPartB()\r\n        {\r\n            product.Add(\"部件Y\");\r\n        }\r\n        public override Product GetResult()\r\n        {\r\n            return product;\r\n        }\r\n    }\r\n    //指挥者类\r\n    class Director {\r\n        public void Construct(Builder builder) {\r\n            builder.BuildPartA();\r\n            builder.BuildPartB();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('23', '建造小人', '建造者模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.ComponentModel;\r\nusing System.Data;\r\nusing System.Drawing;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Windows.Forms;\r\n\r\nnamespace WindowsFormsApplication1\r\n{\r\n    public partial class Form1 : Form\r\n    {\r\n        public Form1()\r\n        {\r\n            InitializeComponent();\r\n        }\r\n\r\n        private void pictureBox1_Click(object sender, EventArgs e)\r\n        {\r\n            Pen p = new Pen(Color.Yellow);\r\n            PersonThinBuilder ptb = new PersonThinBuilder(pictureBox1.CreateGraphics(), p);\r\n            PersonDirector pdThin = new PersonDirector(ptb);\r\n            pdThin.CreatePerson();\r\n            PersonFatBuilder pfb = new PersonFatBuilder(pictureBox1.CreateGraphics(), p);\r\n            PersonDirector pdFat = new PersonDirector(pfb);\r\n            pdFat.CreatePerson();\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class PersonBuilder {\r\n        protected Graphics g;\r\n        protected Pen p;\r\n        public PersonBuilder(Graphics g, Pen p) {\r\n            this.g = g;\r\n            this.p = p;\r\n        }\r\n        public abstract void BuildHead();\r\n        public abstract void BuildBody();\r\n        public abstract void BuildArmLeft();\r\n        public abstract void BuildArmRight();\r\n        public abstract void BuildLegLeft();\r\n        public abstract void BuildLegRight();\r\n    }\r\n    class PersonThinBuilder : PersonBuilder {\r\n        public PersonThinBuilder(Graphics g, Pen p) :base(g,p){ }\r\n        public override void BuildHead()\r\n        {\r\n            g.DrawEllipse(p, 50, 20, 30, 30);\r\n        }\r\n        public override void BuildBody()\r\n        {\r\n            g.DrawEllipse(p, 60, 50, 10, 50);\r\n        }\r\n        public override void BuildArmLeft()\r\n        {\r\n            g.DrawEllipse(p,60,50,40,100);\r\n        }\r\n        public override void BuildArmRight()\r\n        {\r\n            g.DrawEllipse(p,70,50,90,100);\r\n        }\r\n        public override void BuildLegLeft()\r\n        {\r\n            g.DrawEllipse(p,60,100,45,150);\r\n        }\r\n        public override void BuildLegRight()\r\n        {\r\n            g.DrawEllipse(p,70,100,85,150);\r\n        }\r\n    }\r\n    class PersonFatBuilder : PersonBuilder\r\n    {\r\n        public PersonFatBuilder(Graphics g, Pen p) : base(g, p) { }\r\n        public override void BuildHead()\r\n        {\r\n            g.DrawEllipse(p, 50, 20, 30, 30);\r\n        }\r\n        public override void BuildBody()\r\n        {\r\n            g.DrawEllipse(p, 60, 50, 10, 50);\r\n        }\r\n        public override void BuildArmLeft()\r\n        {\r\n            g.DrawEllipse(p, 60, 50, 40, 100);\r\n        }\r\n        public override void BuildArmRight()\r\n        {\r\n            g.DrawEllipse(p, 70, 50, 90, 100);\r\n        }\r\n        public override void BuildLegLeft()\r\n        {\r\n            g.DrawEllipse(p, 60, 100, 45, 150);\r\n        }\r\n        public override void BuildLegRight()\r\n        {\r\n            g.DrawEllipse(p, 70, 100, 85, 150);\r\n        }\r\n    }\r\n    class PersonDirector {\r\n        private PersonBuilder pb;\r\n        public PersonDirector(PersonBuilder pb) {\r\n            this.pb = pb;\r\n        }\r\n        public void CreatePerson() {\r\n            pb.BuildHead();\r\n            pb.BuildBody();\r\n            pb.BuildArmLeft();\r\n            pb.BuildArmRight();\r\n            pb.BuildLegLeft();\r\n            pb.BuildLegRight();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('24', '观察者模式', '观察者模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            ConcreteSubject s = new ConcreteSubject();\r\n            s.Attach(new ConcreteObserver(s, \"X\"));\r\n            s.Attach(new ConcreteObserver(s, \"Y\"));\r\n            s.Attach(new ConcreteObserver(s,\"z\"));\r\n            s.SubjectState = \"ABC\";\r\n            s.Notify();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //抽象观察者\r\n    abstract class Observer{\r\n        public abstract void Update();\r\n    }\r\n    //主题或抽象通知者\r\n    abstract class Subject { \r\n        private IList<Observer> observers=new List<Observer>();\r\n        //增加观察者\r\n        public void Attach(Observer observer){\r\n            observers.Add(observer);\r\n        }\r\n        //移除观察者\r\n        public void Detach(Observer observer) {\r\n            observers.Remove(observer);\r\n        }\r\n        //通知\r\n        public void Notify() {\r\n            foreach (Observer o in observers) {\r\n                o.Update();\r\n            }\r\n        }\r\n    }\r\n    //具体主u题或具体通知者\r\n    class ConcreteSubject : Subject {\r\n        private string subjectState;\r\n        //具体被观察者状态\r\n        public string SubjectState {\r\n            get { return subjectState; }\r\n            set { subjectState = value; }\r\n        }\r\n    }\r\n    //具体观察者\r\n    class ConcreteObserver : Observer {\r\n        private string name;\r\n        private string observerState;\r\n        private ConcreteSubject subject;\r\n        public ConcreteObserver(ConcreteSubject subject,string name){\r\n            this.subject=subject;\r\n            this.name = name;\r\n       }\r\n        public override void Update()\r\n        {\r\n            observerState = subject.SubjectState;\r\n            Console.WriteLine(\"观察者{0}的新状态是{1}\",name,observerState);\r\n        }\r\n        public ConcreteSubject Subject {\r\n            get { return subject; }\r\n            set { subject = value; }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('25', '老板回来了', '观察者模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Boss huhansan = new Boss();\r\n            StockObserver tongshi1 = new StockObserver(\"魏关姹\", huhansan);\r\n            NBAObserver tongshi2 = new NBAObserver(\"易管查\",huhansan);\r\n            huhansan.Update += new EventHandler(tongshi1.CloseStockMarket);\r\n            huhansan.Update += new EventHandler(tongshi2.CloseNBADirectSeeding);\r\n            huhansan.SubjectState = \"我胡汉三回来了！\";\r\n            huhansan.Notify();\r\n            Console.Read();\r\n        }\r\n    }\r\n    interface Subject {//通知者接口\r\n        void Notify();\r\n        string SubjectState\r\n        {\r\n            get;\r\n            set;\r\n        }\r\n    }\r\n    class StockObserver {\r\n        private string name;\r\n        private Subject sub;\r\n        //看股票的同事\r\n        public StockObserver(string name,Subject sub){\r\n            this.name = name;\r\n            this.sub = sub;\r\n    }\r\n        //关闭股票行情\r\n        public void CloseStockMarket() {\r\n            Console.WriteLine(\"{0} {1} 关闭股票行情，继续工作！\",sub.SubjectState,name);\r\n        }\r\n    }\r\n    //看NBA的同事\r\n    class NBAObserver {\r\n        private string name;\r\n        private Subject sub;\r\n        public NBAObserver(string name, Subject sub) {\r\n            this.name = name;\r\n            this.sub = sub;\r\n        }\r\n        //关闭NBA直播\r\n        public void CloseNBADirectSeeding() {\r\n            Console.WriteLine(\"{0} {1} 关闭NBA直播，继续工作！\",sub.SubjectState,name);\r\n        }\r\n    }\r\n    delegate void EventHandler();\r\n    class Boss : Subject { //老板类\r\n        //声明一事件Update，类型为委托EventHandler\r\n        public event EventHandler Update;\r\n        private string action;\r\n        public void Notify() {\r\n            Update();\r\n        }\r\n        public string SubjectState {\r\n            get { return action; }\r\n            set { action = value; }\r\n        }\r\n    }\r\n    class Secretary : Subject {//秘书类\r\n        public event EventHandler Update;\r\n        private string action;\r\n        public void Notify()\r\n        {\r\n            Update();\r\n        }\r\n        public string SubjectState\r\n        {\r\n            get { return action; }\r\n            set { action = value; }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('26', '股票通知', '观察者模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            //Create\r\n            Investor s = new Investor(\"Sorros\");\r\n            Investor b = new Investor(\"Berkshire\");\r\n            //Create IBM stock and attach investors\r\n            IBM ibm = new IBM(\"IBM\",120.00);\r\n            ibm.Attach(s);\r\n            ibm.Attach(b);\r\n            //Change price,which notifies investors\r\n            ibm.Price = 120.10;\r\n            ibm.Price = 121.00;\r\n            ibm.Price = 120.50;\r\n            ibm.Price = 120.75;\r\n            Console.Read();\r\n        }\r\n    }\r\n    // \"Subject\"\r\n\r    abstract class Stock{ \r\n       // Fields\r\n        protected string symbol;\r\n\r        protected double price;\r\n\r        private ArrayList investors = new ArrayList();\r\n      // Constructor\r\n        public Stock(string symbol,double price) {\r\n            this.symbol = symbol;\r\n            this.price = price;\r\n        }\r\n        // Methods\r\n        public void Attach(Investor investor) {\r\n            investors.Add( investor );\r\n        }\r\n        public void Detach(Investor investor) {\r\n            investors.Remove( investor );\r\n        }\r\n        public void Notify() {\r\n            foreach( Investor i in investors)\r\n                i.Update(this);\r\n        }\r\n        // Properties\r\n        public double Price {\r\n            get{ return price; }\r\n            set {\r\n                price = value;\r\n                Notify();\r\n            }\r\n        } \r\n        public string Symbol {\r\n            get { return symbol; }\r\n            set { symbol = value; }\r\n        }\r\n    }\r\n    // \"ConcreteSubject\"\r\n    class IBM : Stock{\r\n        // Constructor\r\n\r        public IBM(string symbol,double price) : base(symbol,price) {}\r\n\r    }\r\n\r    // \"Observer\"\r\n    interface IInvestor{\r\n        // Methods\r\n\r        void Update(Stock stock);\r\n\r    }\r\n    // \"ConcreteObserver\"\r\n    class Investor : IInvestor{\r\n        // Fields\r\n        private string name;\r\n        //private string observerState;\r\n        private Stock stock;\r\n        // Constructors\r\n        public Investor(string name) {\r\n            this.name = name;\r\n        }\r\n        // Methods\r\n        public void Update(Stock stock) {\r\n            Console.WriteLine(\"Notified investor {0} of {1}\'s change to {2:C}\",name,stock.Symbol,stock.Price);\r\n        }\r\n        // Properties\r\n        public Stock Stock {\r\n            get{return stock;}\r\n            set{stock = value;}\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('27', '换DB', '抽象工厂模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Reflection;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            User user = new User();\r\n            Department dept = new Department();\r\n            Iuser iu = DataAccess.CreateUser();\r\n            iu.Insert(user);\r\n            iu.GetUser(1);\r\n            IDepartment id = DataAccess.CreateDepartment();\r\n            id.Insert(dept);\r\n            id.GetDepartment(1);\r\n            Console.Read();\r\n        }\r\n    }\r\n    class User {\r\n        private int _id;\r\n        public int ID {\r\n            get { return _id; }\r\n            set { _id = value; }\r\n        }\r\n        private string _name;\r\n        public string Name {\r\n            get { return _name; }\r\n            set { _name = value; }\r\n        }\r\n    }\r\n    interface Iuser {\r\n        void Insert(User user);\r\n        User GetUser(int id);\r\n    }\r\n    class SqlserverUser : Iuser {\r\n        public void Insert(User user) {\r\n            Console.WriteLine(\"在SQL Server中给User表增加一条记录\");\r\n        }\r\n        public User GetUser(int id) {\r\n            Console.WriteLine(\"在SQL Server中根据ID得到User表的一条记录\");\r\n            return null;\r\n        }\r\n    }\r\n    class AccessUser : Iuser\r\n    {\r\n        public void Insert(User user)\r\n        {\r\n            Console.WriteLine(\"在Access中给User表增加一条记录\");\r\n        }\r\n        public User GetUser(int id)\r\n        {\r\n            Console.WriteLine(\"在Access中根据ID得到User表的一条记录\");\r\n            return null;\r\n        }\r\n    }\r\n    class Department\r\n    {\r\n        private int _id;\r\n        public int ID\r\n        {\r\n            get { return _id; }\r\n            set { _id = value; }\r\n        }\r\n        private string _name;\r\n        public string Name\r\n        {\r\n            get { return _name; }\r\n            set { _name = value; }\r\n        }\r\n    }\r\n    interface IDepartment\r\n    {\r\n        void Insert(Department department);\r\n        Department GetDepartment (int id);\r\n    }\r\n    class SqlserverDepartment : IDepartment\r\n    {\r\n        public void Insert(Department department)\r\n        {\r\n            Console.WriteLine(\"在SQL Server中给Department表增加一条记录\");\r\n        }\r\n        public Department GetDepartment(int id)\r\n        {\r\n            Console.WriteLine(\"在SQL Server中根据ID得到Department表的一条记录\");\r\n            return null;\r\n        }\r\n    }\r\n    class AccessDepartment: IDepartment\r\n    {\r\n        public void Insert(Department department)\r\n        {\r\n            Console.WriteLine(\"在Access中给Department表增加一条记录\");\r\n        }\r\n        public Department GetDepartment(int id)\r\n        {\r\n            Console.WriteLine(\"在Access中根据ID得到Department表的一条记录\");\r\n            return null;\r\n        }\r\n    }\r\n    class DataAccess {\r\n        private static readonly string AssemblyName = \"抽象工厂模式\";\r\n        private static readonly string db = \"Sqlserver\";\r\n        public static Iuser CreateUser() {\r\n            string className = AssemblyName + \".\" + db + \"User\";\r\n            return (Iuser)Assembly.Load(AssemblyName).CreateInstance(className);\r\n        }\r\n        public static IDepartment CreateDepartment()\r\n        {\r\n            string className = AssemblyName + \".\" + db + \"Department\";\r\n            return (IDepartment)Assembly.Load(AssemblyName).CreateInstance(className);\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('28', '状态模式', '状态模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Context c = new Context(new ConcreteStateA());\r\n            c.Request();\r\n            c.Request();\r\n            c.Request();\r\n            c.Request();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //抽象状态类\r\n    abstract class State {\r\n        public abstract void Handle(Context context);\r\n    }\r\n    //具体状态\r\n    class ConcreteStateA : State {\r\n        public override void Handle(Context context)\r\n        {\r\n            context.State = new ConcreteStateB();\r\n        }\r\n    }\r\n    class ConcreteStateB : State {\r\n        public override void Handle(Context context)\r\n        {\r\n            context.State = new ConcreteStateA();\r\n        }\r\n    }\r\n    class Context {\r\n        private State state;\r\n        public Context(State state) {\r\n            this.state = state;\r\n        }\r\n        public State State {\r\n            get { return state; }\r\n            set { state = value; Console.WriteLine(\"当前状态：\" + state.GetType().Name); }\r\n        }\r\n        public void Request() {\r\n            state.Handle(this);\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('29', '无尽加班', '状态模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Work ep = new Work();\r\n            ep.Hour = 9;\r\n            ep.WriteProgram();\r\n            ep.Hour = 10;\r\n            ep.WriteProgram();\r\n            ep.Hour = 12;\r\n            ep.WriteProgram();\r\n            ep.Hour = 13;\r\n            ep.WriteProgram();\r\n            ep.Hour = 14;\r\n            ep.WriteProgram();\r\n            ep.Hour = 17;\r\n            ep.WriteProgram();\r\n            ep.TaskFinished = false;\r\n            ep.WriteProgram();\r\n            ep.Hour = 19;\r\n            ep.WriteProgram();\r\n            ep.Hour = 22;\r\n            ep.WriteProgram();\r\n            Console.Read();\r\n        }\r\n    }\r\n    public class Work {\r\n        private State current;\r\n        public Work() {\r\n            current = new ForenoonState();\r\n        }\r\n        private double hour;\r\n        public double Hour {\r\n            get { return hour; }\r\n            set { hour = value; }\r\n        }\r\n        private bool finish = false;\r\n        public bool TaskFinished {\r\n            get { return finish; }\r\n            set { finish = value; }\r\n        }\r\n        public void SetState(State s) {\r\n            current = s;\r\n        }\r\n        public void WriteProgram (){\r\n            current.WriteProgram(this);\r\n        }\r\n    }\r\n    //抽象状态\r\n    public abstract class State {\r\n        public abstract void WriteProgram(Work w);\r\n    }\r\n    //上午工作状态\r\n    public class ForenoonState : State {\r\n        public override void WriteProgram(Work w)\r\n        {\r\n            if (w.Hour < 12)\r\n            {\r\n                Console.WriteLine(\"当前时间： {0}点 上午工作，精神百倍\", w.Hour);\r\n            }\r\n            else {\r\n                w.SetState(new NoonState());\r\n                w.WriteProgram();\r\n            }\r\n        }\r\n    }\r\n    //中午工作状态\r\n    public class NoonState : State {\r\n        public override void WriteProgram(Work w)\r\n        {\r\n            if (w.Hour < 13)\r\n            {\r\n                Console.WriteLine(\"当前时间： {0}点 饿了，午饭，犯困，午休。\", w.Hour);\r\n            }\r\n            else {\r\n                w.SetState(new AfternoonState());\r\n                w.WriteProgram();\r\n            }\r\n        }\r\n    }\r\n    //下午和傍晚工作状态\r\n    public class AfternoonState : State {\r\n        public override void WriteProgram(Work w)\r\n        {\r\n            if (w.Hour < 17)\r\n            {\r\n                Console.WriteLine(\"当前时间： {0}点 下午状态还不错，继续努力。\", w.Hour);\r\n            }\r\n            else\r\n            {\r\n                w.SetState(new EveningState());\r\n                w.WriteProgram();\r\n            }\r\n        }\r\n    }\r\n    //晚间工作状态\r\n    public class EveningState : State {\r\n        public override void WriteProgram(Work w)\r\n        {\r\n            if (w.TaskFinished)\r\n            {\r\n                w.SetState(new RestState());\r\n                w.WriteProgram();\r\n            }\r\n            else\r\n            {\r\n                if (w.Hour < 21)\r\n                {\r\n                    Console.WriteLine(\"当前时间： {0}点 加班哦，疲累至极。\", w.Hour);\r\n                }\r\n                else\r\n                {\r\n                    w.SetState(new SleepingState());\r\n                    w.WriteProgram();\r\n                }\r\n            }\r\n        }\r\n    }\r\n    //睡眠状态\r\n    public class SleepingState : State {\r\n        public override void WriteProgram(Work w)\r\n        {\r\n            Console.WriteLine(\"当前时间： {0}点 不行了，睡着了。\", w.Hour);\r\n        }\r\n    }\r\n    //下班休息\r\n    public class RestState : State\r\n    {\r\n        public override void WriteProgram(Work w)\r\n        {\r\n            Console.WriteLine(\"当前时间： {0}点 点下班回家了。\", w.Hour);\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('30', '适配器模式', '适配器模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Target target = new Adapter();\r\n            target.Request();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //客户所期待的接口\r\n    class Target {\r\n        public virtual void Request() {\r\n            Console.WriteLine(\"普通请求！\");\r\n        }\r\n    }\r\n    //需要适配的类\r\n    class Adaptee {\r\n        public void SepcificRequest() {\r\n            Console.WriteLine(\"特殊请求\");\r\n        }\r\n    }\r\n    //在内部包装一个Adaptee对象，把原接口转换成目标接口\r\n    class Adapter : Target {\r\n        private Adaptee adaptee = new Adaptee();\r\n        public override void Request()\r\n        {\r\n            adaptee.SepcificRequest();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('31', '在NBA我需要翻译', '适配器模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        { \r\n            Player b=new Forwards(\"巴蒂尔\");\r\n            b.Attack();\r\n            Player m=new Guards(\"麦克格雷迪\");\r\n            m.Attack();\r\n            Player ym=new Translator(\"姚明\");\r\n            ym.Attack();\r\n            ym.Defense();\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class Player {\r\n        protected string name;\r\n        public Player(string name) {\r\n            this.name = name;\r\n        }\r\n        public abstract void Attack();\r\n        public abstract void Defense();\r\n    }\r\n    class Forwards : Player {\r\n        public Forwards(string name) : base(name) { }\r\n        public override void Attack()\r\n        {\r\n            Console.WriteLine(\"前锋{0}进攻\",name);\r\n        }\r\n        public override void Defense()\r\n        {\r\n            Console.WriteLine(\"前锋{0}防守\", name);\r\n        }\r\n    }\r\n    class Center : Player { \r\n        public Center(string name) : base(name) { }\r\n        public override void Attack()\r\n        {\r\n            Console.WriteLine(\"中锋{0}进攻\",name);\r\n        }\r\n        public override void Defense()\r\n        {\r\n            Console.WriteLine(\"中锋{0}防守\", name);\r\n        }\r\n    }\r\n    class Guards : Player\r\n    {\r\n        public Guards(string name) : base(name) { }\r\n        public override void Attack()\r\n        {\r\n            Console.WriteLine(\"后卫{0}进攻\", name);\r\n        }\r\n        public override void Defense()\r\n        {\r\n            Console.WriteLine(\"后卫{0}防守\", name);\r\n        }\r\n    }\r\n    class ForeignCenter{\r\n        private string name;\r\n        public string Name{\r\n            get{return name;}\r\n            set{name=value;}\r\n        }\r\n        public void 进攻(){\r\n            Console.WriteLine(\"外籍中锋{0}进攻\",name);\r\n        }\r\n        public void 防守(){\r\n            Console.WriteLine(\"外籍中锋{0}防守\",name);\r\n        }\r\n    }\r\n    class Translator:Player{\r\n        private ForeignCenter wjzf=new ForeignCenter();\r\n        public Translator(string name):base(name){\r\n            wjzf.Name=name;\r\n        }\r\n        public override void  Attack(){\r\n 	        wjzf.进攻();\r\n        }\r\n        public override void  Defense(){\r\n 	        wjzf.防守();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('32', '备忘录模式', '备忘录模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Originator o = new Originator();\r\n            o.State = \"On\";\r\n            o.Show();\r\n            Caretaker c = new Caretaker();\r\n            c.Memento = o.CreateMemento();\r\n            o.State = \"OFF\";\r\n            o.Show();\r\n            o.SetMemento(c.Memento);\r\n            o.Show();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //发起人\r\n    class Originator {\r\n        private string state;\r\n        public string State{\r\n            get { return state; }\r\n            set { state = value; }\r\n        }\r\n        public Memento CreateMemento() {\r\n            return (new Memento(state));\r\n        }\r\n        public void SetMemento(Memento memento) {\r\n            state = memento.State;\r\n        }\r\n        public void Show() {\r\n            Console.WriteLine(\"State=\" + state);\r\n        }\r\n    }\r\n    //备忘录类\r\n    class Memento {\r\n        private string state;\r\n        public Memento(string state) {\r\n            this.state = state;\r\n        }\r\n        public string State {\r\n            get { return state; }\r\n        }\r\n    }\r\n    //管理者类\r\n    class Caretaker {\r\n        private Memento memento;\r\n        public Memento Memento {\r\n            get { return memento; }\r\n            set { memento = value; }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('33', '保存游戏进度', '备忘录模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            //大战Boss之前\r\n            GameRole lixiaoyao = new GameRole();\r\n            lixiaoyao.GetInitState();\r\n            lixiaoyao.StateDisplay();\r\n            //保存进度\r\n            RoleStateCaretaker stateAdmin = new RoleStateCaretaker();\r\n            stateAdmin.Memento = lixiaoyao.SaveState();\r\n            //大战Boss时，损耗严重\r\n            lixiaoyao.Fight();\r\n            lixiaoyao.StateDisplay();\r\n            //恢复之前状态\r\n            lixiaoyao.RecoveryState(stateAdmin.Memento);\r\n            lixiaoyao.StateDisplay();\r\n            Console.Read();\r\n        }\r\n    }\r\n    class GameRole { \r\n        //生命力\r\n        private int vit;\r\n        public int Vitality {\r\n            get { return vit; }\r\n            set { vit = value; }\r\n        }\r\n        //攻击力\r\n        private int atk;\r\n        public int Attack {\r\n            get { return atk; }\r\n            set { atk = value; }\r\n        }\r\n        //防御力\r\n        private int def;\r\n        public int Defense {\r\n            get { return def; }\r\n            set { def = value; }\r\n        }\r\n        //状态显示\r\n        public void StateDisplay() {\r\n            Console.WriteLine(\"角色当前状态：\");\r\n            Console.WriteLine(\"体力：{0}\",this.vit);\r\n            Console.WriteLine(\"攻击力：{0}\",this.atk);\r\n            Console.WriteLine(\"防御力：{0}\",this.def);\r\n            Console.WriteLine(\" \");\r\n        }\r\n        //获得初始状态\r\n        public void GetInitState() {\r\n            this.vit = 100;\r\n            this.atk = 100;\r\n            this.def = 100;\r\n        }\r\n        //战斗\r\n        public void Fight() {\r\n            this.vit = 0;\r\n            this.atk = 0;\r\n            this.def = 0;\r\n        }\r\n        //保存角色状态\r\n        public RoleStateMemento SaveState() {\r\n            return (new RoleStateMemento(vit, atk, def));\r\n        }\r\n        //恢复角色状态\r\n        public void RecoveryState(RoleStateMemento memento) {\r\n            this.vit = memento.Vitality;\r\n            this.atk = memento.Attack;\r\n            this.def = memento.Defense;\r\n        }\r\n    }\r\n    //角色状态存储箱\r\n    class RoleStateMemento { \r\n        private int vit;\r\n        private int atk;\r\n        private int def;\r\n        public RoleStateMemento(int vit, int atk, int def) {\r\n            this.vit = vit;\r\n            this.atk = atk;\r\n            this.def = def;\r\n        }\r\n        //生命力\r\n        public int Vitality\r\n        {\r\n            get { return vit; }\r\n            set { vit = value; }\r\n        }\r\n        //攻击力\r\n        public int Attack\r\n        {\r\n            get { return atk; }\r\n            set { atk = value; }\r\n        }\r\n        //防御力\r\n        public int Defense\r\n        {\r\n            get { return def; }\r\n            set { def = value; }\r\n        }\r\n    }\r\n    //角色状态管理类\r\n    class RoleStateCaretaker {\r\n        private RoleStateMemento memento;\r\n        public RoleStateMemento Memento {\r\n            get { return memento; }\r\n            set { memento = value; }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('34', '组合模式', '组合模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Composite root=new Composite(\"root\");\r\n            root.Add(new Leaf(\"Leaf A\"));\r\n            root.Add(new Leaf(\"Leaf B\"));\r\n            Composite comp=new Composite(\"Composite X\");\r\n            comp.Add(new Leaf(\"Leaf XA\"));\r\n            comp.Add(new Leaf(\"Leaf XB\"));\r\n            root.Add(comp);\r\n            Composite comp2=new Composite(\"Composite XY\");\r\n            comp2.Add(new Leaf(\"Leaf XYA\"));\r\n            comp2.Add(new Leaf(\"Leaf XYB\"));\r\n            comp.Add(comp2);\r\n            root.Add(new Leaf(\"Leaf C\"));\r\n            Leaf leaf=new Leaf(\"Leaf D\");\r\n            root.Add(leaf);\r\n            root.Remove(leaf);\r\n            root.Display(1);\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class Component {\r\n        protected string name;\r\n        public Component(string name) {\r\n            this.name = name;\r\n        }\r\n        public abstract void Add(Component c);\r\n        public abstract void Remove(Component c);\r\n        public abstract void Display(int depth);\r\n    }\r\n    //叶节点\r\n    class Leaf : Component {\r\n        public Leaf(string name) : base(name) { }\r\n        public override void Add(Component c)\r\n        {\r\n            Console.WriteLine(\"Cannot add to a leaf\");\r\n        }\r\n        public override void Remove(Component c)\r\n        {\r\n            Console.WriteLine(\"Cannot remove from a leaf\");\r\n        }\r\n        public override void Display(int depth)\r\n        {\r\n            Console.WriteLine(new String(\'-\',depth)+name);\r\n        }\r\n    }\r\n    //枝节点\r\n    class Composite : Component { \r\n        private List<Component>children=new List<Component>();\r\n        public Composite(string name):base(name){}\r\n        public override void  Add(Component c){\r\n 	        children.Add(c);\r\n        }\r\n        public override void  Remove(Component c){\r\n 	        children.Remove(c);\r\n        }\r\n        public override void Display(int depth)\r\n        {\r\n            Console.WriteLine(new String(\'-\',depth)+name);\r\n            foreach(Component component in children){\r\n                component.Display(depth+2);\r\n            }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('35', '公司管理', '组合模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Company root = new ConcreteCompany(\"北京总公司\");\r\n            root.Add(new HRDepartment(\"总公司人力资源部\"));\r\n            root.Add(new FinanceDepartment(\"总公司财务部\"));\r\n            Company comp = new ConcreteCompany(\"上海华东分公司\");\r\n            comp.Add(new HRDepartment(\"华东分公司人力资源部\"));\r\n            comp.Add(new FinanceDepartment(\"华东分公司财务部\"));\r\n            root.Add(comp);\r\n            ConcreteCompany comp1 = new ConcreteCompany(\"南京办事处\");\r\n            comp1.Add(new HRDepartment(\"南京办事处人力资源部\"));\r\n            comp1.Add(new FinanceDepartment(\"南京办事处财务部\"));\r\n            comp.Add(comp1);\r\n            ConcreteCompany comp2 = new ConcreteCompany(\"杭州办事处\");\r\n            comp2.Add(new HRDepartment(\"杭州办事处人力资源部\"));\r\n            comp2.Add(new FinanceDepartment(\"杭州办事处财务部\"));\r\n            comp.Add(comp2);\r\n            Console.WriteLine(\"\\n结构图：\");\r\n            root.Display(1);\r\n            Console.WriteLine(\"\\n职责：\");\r\n            root.LineOfDuty();\r\n            Console.Read();\r\n        }\r\n    }\r\n    //公司类\r\n    abstract class Company {\r\n        protected string name;\r\n        public Company(string name) {\r\n            this.name = name;\r\n        }\r\n        public abstract void Add(Company c);\r\n        public abstract void Remove(Company c);\r\n        public abstract void Display(int depth);\r\n        public abstract void LineOfDuty();\r\n    }\r\n    //具体公司类\r\n    class ConcreteCompany : Company { \r\n        private List<Company>children=new List<Company>();\r\n        public ConcreteCompany(string name):base(name){}\r\n        public override void  Add(Company c){\r\n 	        children.Add(c);\r\n        }\r\n        public override void  Remove(Company c){\r\n 	        children.Remove(c);\r\n        }\r\n        public override void Display(int depth)\r\n        {\r\n            Console.WriteLine(new String(\'-\',depth)+name);\r\n            foreach(Company component in children){\r\n                component.Display(depth+2);\r\n            }\r\n        }\r\n        //履行职责\r\n        public override void LineOfDuty()\r\n        {\r\n            foreach(Company component in children){\r\n                component.LineOfDuty();\r\n            }\r\n        }\r\n    }\r\n    //人力资源部\r\n    class HRDepartment:Company{\r\n        public HRDepartment(string name):base(name){}\r\n        public override void  Add(Company c){}\r\n        public override void  Remove(Company c){}\r\n        public override void Display(int depth)\r\n        {\r\n            Console.WriteLine(new String(\'-\',depth)+name);\r\n        }\r\n        public override void  LineOfDuty(){\r\n 	        Console.WriteLine(\"{0}员工招聘培训管理\",name);\r\n        }\r\n    }\r\n    //财务部\r\n    class FinanceDepartment:Company{\r\n        public FinanceDepartment(string name):base(name){}\r\n        public override void  Add(Company c){}\r\n        public override void  Remove(Company c){}\r\n        public override void Display(int depth)\r\n        {\r\n            Console.WriteLine(new String(\'-\',depth)+name);\r\n        }\r\n        public override void  LineOfDuty(){\r\n 	        Console.WriteLine(\"{0}公司财务收支管理\",name);\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('36', '迭代器模式', '迭代器模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            ConcreteAggregate a = new ConcreteAggregate();\r\n            a[0] = \"大鸟\";\r\n            a[1] = \"小菜\";\r\n            a[2] = \"行李\";\r\n            a[3] = \"老外\";\r\n            a[4] = \"公交内部员工\";\r\n            a[5] = \"小偷\";\r\n            Iterator i = new ConcreteIterator(a);\r\n            object item = i.First();\r\n            while (!i.IsDone()) {\r\n                Console.WriteLine(\"{0}请买车票！\", i.CurrentItem());\r\n                i.Next();\r\n            }\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class Iterator {\r\n        public abstract object First();\r\n        public abstract object Next();\r\n        public abstract bool IsDone();\r\n        public abstract object CurrentItem();\r\n    }\r\n    abstract class Aggregate {\r\n        public abstract Iterator CreateIterator();\r\n    }\r\n    class ConcreteIterator : Iterator {\r\n        private ConcreteAggregate aggregate;\r\n        private int current = 0;\r\n        public ConcreteIterator(ConcreteAggregate aggregate) {\r\n            this.aggregate = aggregate;\r\n        }\r\n        public override object First()\r\n        {\r\n            return aggregate[0];\r\n        }\r\n        public override object Next()\r\n        {\r\n            object ret = null;\r\n            current++;\r\n            if (current < aggregate.Count) {\r\n                ret = aggregate[current];\r\n            }\r\n            return ret;\r\n        }\r\n        public override bool IsDone()\r\n        {\r\n            return current >= aggregate.Count ? true : false;\r\n        }\r\n        public override object CurrentItem()\r\n        {\r\n            return aggregate[current];\r\n        }\r\n    }\r\n    class ConcreteAggregate:Aggregate{\r\n        private IList<object> items=new List<object>();\r\n        public override Iterator CreateIterator()\r\n        {\r\n            return new ConcreteIterator(this);\r\n        }\r\n        public int Count { \r\n            get { return items.Count; }\r\n        }\r\n        public object this[int index] {\r\n            get { return items[index]; }\r\n            set { items.Insert(index, value); }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('37', '单例模式', '单例模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Singleton s1 = Singleton.GetInstance();\r\n            Singleton s2 = Singleton.GetInstance();\r\n            if (s1 == s2) {\r\n                Console.WriteLine(\"两个对象是相同的实例。\");\r\n            }\r\n            Console.Read();\r\n        }\r\n    }\r\n    class Singleton {\r\n        private static Singleton instance;\r\n        private Singleton() { }\r\n        public static Singleton GetInstance() {\r\n            if (instance == null) {\r\n                instance = new Singleton();\r\n            }\r\n            return instance;\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('38', '桥接模式', '桥接模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Abstraction ab = new RefinedAbstraction();\r\n            ab.SetImplementor(new ConcreteImplementorA());\r\n            ab.Operation();\r\n            ab.SetImplementor(new ConcreteImplementorB());\r\n            ab.Operation();\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class Implementor {\r\n        public abstract void Operation();\r\n    }\r\n    class ConcreteImplementorA : Implementor {\r\n        public override void Operation()\r\n        {\r\n            Console.WriteLine(\"具体算法A执行\");\r\n        }\r\n    }\r\n    class ConcreteImplementorB : Implementor\r\n    {\r\n        public override void Operation()\r\n        {\r\n            Console.WriteLine(\"具体算法B执行\");\r\n        }\r\n    }\r\n    class Abstraction {\r\n        protected Implementor implementor;\r\n        public void SetImplementor(Implementor implementor) {\r\n            this.implementor = implementor;\r\n        }\r\n        public virtual void Operation() {\r\n            implementor.Operation();\r\n        }\r\n    }\r\n    class RefinedAbstraction : Abstraction {\r\n        public override void Operation()\r\n        {\r\n            implementor.Operation();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('39', '手机软件何时统一', '桥接模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            HandsetBrand ab;\r\n            ab = new HandsetBrandN();\r\n            ab.SetHandsetSoft(new HandsetGame());\r\n            ab.Run();\r\n            ab.SetHandsetSoft(new HangsetAddressList());\r\n            ab.Run();\r\n            ab = new HandsetSoftM();\r\n            ab.SetHandsetSoft(new HandsetGame());\r\n            ab.Run();\r\n            ab.SetHandsetSoft(new HangsetAddressList());\r\n            ab.Run();\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class HandsetSoft {\r\n        public abstract void Run();\r\n    }\r\n    class HandsetGame : HandsetSoft {\r\n        public override void Run()\r\n        {\r\n            Console.WriteLine(\"运行手机游戏\");\r\n        }\r\n    }\r\n    class HangsetAddressList : HandsetSoft {\r\n        public override void Run()\r\n        {\r\n            Console.WriteLine(\"运行手机通讯录\");\r\n        }\r\n    }\r\n    abstract class HandsetBrand {\r\n        protected HandsetSoft soft;\r\n        public void SetHandsetSoft(HandsetSoft soft) {\r\n            this.soft = soft;\r\n        }\r\n        public abstract void Run();\r\n    }\r\n    class HandsetBrandN : HandsetBrand {\r\n        public override void Run()\r\n        {\r\n            soft.Run();\r\n        }\r\n    }\r\n    class HandsetSoftM : HandsetBrand {\r\n        public override void Run()\r\n        {\r\n            soft.Run();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('40', '命令模式', '命令模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Reciever r = new Reciever();\r\n            Command c = new ConcreteCommand(r);\r\n            Invoker i = new Invoker();\r\n            i.SetCommand(c);\r\n            i.ExecuteCommand();\r\n            Console.Read();\r\n        }\r\n    }\r\n    class Reciever{\r\n        public void Action(){\r\n            Console.WriteLine(\"执行请求\");\r\n        }\r\n    }\r\n    abstract class Command {\r\n        protected Reciever reciever;\r\n        public Command(Reciever reciever) {\r\n            this.reciever = reciever;\r\n        }\r\n        abstract public void Execute();\r\n    }\r\n    class ConcreteCommand : Command {\r\n        public ConcreteCommand(Reciever reciever) : base(reciever) { }\r\n        public override void Execute()\r\n        {\r\n            reciever.Action();\r\n        }\r\n    }\r\n    class Invoker {\r\n        private Command command;\r\n        public void SetCommand(Command command) {\r\n            this.command = command;\r\n        }\r\n        public void ExecuteCommand() {\r\n            command.Execute();\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('41', '烤羊肉串', '命令模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Barbecuer boy = new Barbecuer();\r\n            Command bakeMuttonCommand1 = new BakeMuttonCommand(boy);\r\n            Command bakeMuttonCommand2 = new BakeMuttonCommand(boy);\r\n            Command bakeChickenWingCommand1 = new BakeChickenWingCommand(boy);\r\n            Waiter girl = new Waiter();\r\n            girl.SetOrder(bakeMuttonCommand1);\r\n            girl.SetOrder(bakeMuttonCommand2);\r\n            girl.SetOrder(bakeChickenWingCommand1);\r\n            girl.Notify();\r\n            Console.Read();\r\n        }\r\n    }\r\n    public class Barbecuer{\r\n        public void BakeMutton(){\r\n            Console.WriteLine(\"烤羊肉串！\");\r\n        }\r\n        public void BakeChickenWing(){\r\n            Console.WriteLine(\"烤鸡翅！\");\r\n        }\r\n    }\r\n    public abstract class Command {\r\n        protected Barbecuer receiver;\r\n        public Command(Barbecuer receiver) {\r\n            this.receiver = receiver;\r\n        }\r\n        abstract public void ExcuteCommand();\r\n    }\r\n    class BakeMuttonCommand : Command {\r\n        public BakeMuttonCommand(Barbecuer receiver) : base(receiver) { }\r\n        public override void ExcuteCommand()\r\n        {\r\n            receiver.BakeMutton();\r\n        }\r\n    }\r\n    class BakeChickenWingCommand : Command {\r\n        public BakeChickenWingCommand(Barbecuer receiver) : base(receiver) { }\r\n        public override void ExcuteCommand()\r\n        {\r\n            receiver.BakeChickenWing();\r\n        }\r\n    }\r\n    public class Waiter\r\n    {\r\n        private IList<Command> orders = new List<Command>();\r\n        public void SetOrder(Command command)\r\n        {\r\n            if (command.ToString() == \"命令模式.BakeChickenWingCommand\")\r\n            {\r\n                Console.WriteLine(\"服务员：鸡翅没有了，请点别的烧烤。\");\r\n            }\r\n            else\r\n            {\r\n                orders.Add(command);\r\n                Console.WriteLine(\"增加订单：\" + command.ToString());\r\n            }\r\n        }\r\n        public void CancelOrder(Command command) {\r\n            orders.Remove(command);\r\n            Console.WriteLine(\"取消订单：\"+command.ToString());\r\n        }\r\n        public void Notify() {\r\n            foreach (Command cmd in orders) {\r\n                cmd.ExcuteCommand();\r\n            }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('42', '职责链模式', '职责链模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            Handler h1 = new Concretehandler1();\r\n            Handler h2 = new Concretehandler2();\r\n            Handler h3 = new Concretehandler3();\r\n            h1.SetSuccessor(h2);\r\n            h2.SetSuccessor(h3);\r\n            int[] requests={2,5,14,22,18,3,27,20};\r\n            foreach (int request in requests) {\r\n                h1.HandleRequest(request);\r\n            }\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class Handler {\r\n        protected Handler successor;\r\n        public void SetSuccessor(Handler successor) {\r\n            this.successor = successor;\r\n        }\r\n        public abstract void HandleRequest(int request);\r\n    }\r\n    class Concretehandler1 : Handler {\r\n        public override void HandleRequest(int request)\r\n        {\r\n            if (request >= 0 && request < 10) { \r\n                Console.WriteLine(\"{0}处理请求{1}\",this.GetType().Name,request );\r\n            }\r\n            else if (successor != null) {\r\n                successor.HandleRequest(request);\r\n            }\r\n        }\r\n    }\r\n    class Concretehandler2 : Handler\r\n    {\r\n        public override void HandleRequest(int request)\r\n        {\r\n            if (request >= 10 && request < 20)\r\n            {\r\n                Console.WriteLine(\"{0}处理请求{1}\", this.GetType().Name, request);\r\n            }\r\n            else if (successor != null)\r\n            {\r\n                successor.HandleRequest(request);\r\n            }\r\n        }\r\n    }\r\n    class Concretehandler3 : Handler\r\n    {\r\n        public override void HandleRequest(int request)\r\n        {\r\n            if (request >= 20 && request < 30)\r\n            {\r\n                Console.WriteLine(\"{0}处理请求{1}\", this.GetType().Name, request);\r\n            }\r\n            else if (successor != null)\r\n            {\r\n                successor.HandleRequest(request);\r\n            }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('43', '加薪非要老总批', '职责链模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            CommonManager jinji = new CommonManager(\"金立\");\r\n            Majordomo zongjian = new Majordomo(\"总监\");\r\n            GeneralManager zhongjinli = new GeneralManager(\"重金礼\");\r\n            jinji.SetSuperior(zongjian);\r\n            zongjian.SetSuperior(zhongjinli);\r\n            Request request = new Request();\r\n            request.RequestType = \"请假\";\r\n            request.RequestContent = \"小菜请假\";\r\n            request.Number = 1;\r\n            jinji.RequestApplications(request);\r\n            Request request2 = new Request();\r\n            request.RequestType = \"请假\";\r\n            request.RequestContent = \"小菜请假\";\r\n            request.Number = 4;\r\n            jinji.RequestApplications(request2);\r\n            Request request3 = new Request();\r\n            request.RequestType = \"加薪\";\r\n            request.RequestContent = \"小菜加薪\";\r\n            request.Number = 500;\r\n            jinji.RequestApplications(request3);\r\n            Request request4 = new Request();\r\n            request.RequestType = \"加薪\";\r\n            request.RequestContent = \"小菜加薪\";\r\n            request.Number = 1000;\r\n            jinji.RequestApplications(request4);\r\n            Console.Read();\r\n        }\r\n    }\r\n    class Request {\r\n        private string requestType;\r\n        public string RequestType {\r\n            get { return requestType; }\r\n            set { requestType = value; }\r\n        }\r\n        private string requestContent;\r\n        public string RequestContent {\r\n            get { return requestContent; }\r\n            set { requestContent = value; }\r\n        }\r\n        private int number;\r\n        public int Number {\r\n            get { return number; }\r\n            set { number = value; }\r\n        }\r\n    }\r\n    abstract class Manager {\r\n        protected string name;\r\n        protected Manager superior;\r\n        public Manager(string name) {\r\n            this.name = name;\r\n        }\r\n        public void SetSuperior(Manager superior) {\r\n            this.superior = superior;\r\n        }\r\n        abstract public void RequestApplications(Request request);\r\n    }\r\n    class CommonManager : Manager {\r\n        public CommonManager(string name) :base(name){}\r\n        public override void RequestApplications(Request request)\r\n        {\r\n            if (request.RequestType == \"请假\" && request.Number <= 2)\r\n            {\r\n                Console.WriteLine(\"{0}:{1}数量{2}被批准\", name, request.RequestContent, request.Number);\r\n            }\r\n            else {\r\n                if (superior != null)\r\n                    superior.RequestApplications(request);\r\n            }\r\n        }\r\n    }\r\n    class Majordomo : Manager {\r\n        public Majordomo(string name) : base(name) { }\r\n        public override void RequestApplications(Request request)\r\n        {\r\n            if (request.RequestType == \"请假\" && request.Number <= 5)\r\n            {\r\n                Console.WriteLine(\"{0}:{1}数量{2}被批准\", name, request.RequestContent, request.Number);\r\n            }\r\n            else\r\n            {\r\n                if (superior != null)\r\n                    superior.RequestApplications(request);\r\n            }\r\n        }\r\n    }\r\n    class GeneralManager : Manager\r\n    {\r\n        public GeneralManager(string name) : base(name) { }\r\n        public override void RequestApplications(Request request)\r\n        {\r\n            if (request.RequestType == \"请假\")\r\n            {\r\n                Console.WriteLine(\"{0}:{1}数量{2}被批准\", name, request.RequestContent, request.Number);\r\n            }\r\n            else if (request.RequestType == \"加薪\" && request.Number <= 500) {\r\n                Console.WriteLine(\"{0}:{1}数量{2}被批准\", name, request.RequestContent, request.Number);\r\n            }\r\n            else if (request.RequestType == \"加薪\" && request.Number > 500) {\r\n                Console.WriteLine(\"{0}:{1}数量{2}被批准\", name, request.RequestContent, request.Number);\r\n            }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('44', '中介者模式', '中介者模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            ConcreteMediator m = new ConcreteMediator();\r\n            ConcreteColleague1 c1 = new ConcreteColleague1(m);\r\n            ConcreteColleague2 c2 = new ConcreteColleague2(m);\r\n            m.Colleague1 = c1;\r\n            m.Colleague2 = c2;\r\n            c1.Send(\"吃过饭了么？\");\r\n            c2.Send(\"没有呢，你打算请客？\");\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class Mediator {\r\n        public abstract void Send(string message, Colleague colleague);\r\n    }\r\n    abstract class Colleague\r\n    {\r\n        protected Mediator mediator;\r\n        public Colleague(Mediator mediator)\r\n        {\r\n            this.mediator = mediator;\r\n        }\r\n    }\r\n    class ConcreteColleague1 : Colleague {\r\n        public ConcreteColleague1(Mediator mediator) : base(mediator) { }\r\n        public void Send(string message) {\r\n            mediator.Send(message, this);\r\n        }\r\n        public void Notify(string message) {\r\n            Console.WriteLine(\"同事1得到消息：\" + message);\r\n        }\r\n    }\r\n    class ConcreteColleague2 : Colleague\r\n    {\r\n        public ConcreteColleague2(Mediator mediator) : base(mediator) { }\r\n        public void Send(string message)\r\n        {\r\n            mediator.Send(message, this);\r\n        }\r\n        public void Notify(string message) {\r\n            Console.WriteLine(\"同事2得到消息：\" + message);\r\n        }\r\n    }\r\n    class ConcreteMediator : Mediator {\r\n        private ConcreteColleague1 colleague1;\r\n        private ConcreteColleague2 colleague2;\r\n        public ConcreteColleague1 Colleague1 {\r\n            set { colleague1 = value; }\r\n        }\r\n        public ConcreteColleague2 Colleague2 {\r\n            set { colleague2 = value; }\r\n        }\r\n        public override void Send(string message, Colleague colleague)\r\n        {\r\n            if (colleague == colleague1)\r\n            {\r\n                colleague2.Notify(message);\r\n            }\r\n            else {\r\n                colleague1.Notify(message);\r\n            }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('45', '世界需要和平', '中介者模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            UnitedNationsSecurityCouncil UNSC = new UnitedNationsSecurityCouncil();\r\n            USA c1 = new USA(UNSC);\r\n            Iraq c2 = new Iraq(UNSC);\r\n            UNSC.Colleague1 = c1;\r\n            UNSC.Colleague2 = c2;\r\n            c1.Declare(\"不准研制和武器\");\r\n            c2.Declare(\"不怕\");\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class UnitedNations {\r\n        public abstract void Declare(string message, Country colleague);\r\n    }\r\n    abstract class Country {\r\n        protected UnitedNations mediator;\r\n        public Country(UnitedNations mediator) {\r\n            this.mediator = mediator;\r\n        }\r\n    }\r\n    class USA : Country {\r\n        public USA(UnitedNations mediator) : base(mediator) { }\r\n        public void Declare(string message) {\r\n            mediator.Declare(message, this);\r\n        }\r\n        public void GetMessage(string message) {\r\n            Console.WriteLine(\"美国获得的对方信息：\" + message);\r\n        }\r\n    }\r\n    class Iraq : Country\r\n    {\r\n        public Iraq(UnitedNations mediator) : base(mediator) { }\r\n        public void Declare(string message)\r\n        {\r\n            mediator.Declare(message, this);\r\n        }\r\n        public void GetMessage(string message)\r\n        {\r\n            Console.WriteLine(\"伊拉克获得的对方信息：\" + message);\r\n        }\r\n    }\r\n    class UnitedNationsSecurityCouncil : UnitedNations {\r\n        private USA colleague1;\r\n        private Iraq colleague2;\r\n        public USA Colleague1 {\r\n            set { colleague1 = value; }\r\n        }\r\n        public Iraq Colleague2 {\r\n            set { colleague2 = value; }\r\n        }\r\n        public override void Declare(string message, Country colleague)\r\n        {\r\n            if (colleague == colleague1)\r\n            {\r\n                colleague2.GetMessage(message);\r\n            }\r\n            else {\r\n                colleague1.GetMessage(message);\r\n            }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('46', '享元模式', '享元模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            int extrinsicstate = 22;\r\n            FlyweightFactory f = new FlyweightFactory();\r\n            FlyWeight fx = f.GetFlyweight(\"X\");\r\n            fx.Operation(--extrinsicstate);\r\n            FlyWeight fy = f.GetFlyweight(\"Y\");\r\n            fx.Operation(--extrinsicstate);\r\n            FlyWeight fz = f.GetFlyweight(\"Z\");\r\n            fx.Operation(--extrinsicstate);\r\n            FlyWeight uf = new UsharedConcreteFlyweight();\r\n            uf.Operation(--extrinsicstate);\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class FlyWeight {\r\n        public abstract void Operation(int extrinsicstate);\r\n    }\r\n    class ConcreteFlyweight : FlyWeight {\r\n        public override void Operation(int extrinsicstate)\r\n        {\r\n            Console.WriteLine(\"具体Flyweight:\"+extrinsicstate);\r\n        }\r\n    }\r\n    class UsharedConcreteFlyweight : FlyWeight\r\n    {\r\n        public override void Operation(int extrinsicstate)\r\n        {\r\n            Console.WriteLine(\"不共享的具体Flyweight:\" + extrinsicstate);\r\n        }\r\n    }\r\n    class FlyweightFactory {\r\n        private Hashtable flyweghts = new Hashtable();\r\n        public FlyweightFactory() {\r\n            flyweghts.Add(\"X\", new ConcreteFlyweight());\r\n            flyweghts.Add(\"Y\", new ConcreteFlyweight());\r\n            flyweghts.Add(\"Z\", new ConcreteFlyweight());\r\n        }\r\n        public FlyWeight GetFlyweight(string key) {\r\n            return ((FlyWeight)flyweghts[key]);\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('47', '项目多也别傻做', '享元模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            WebSiteFactory f = new WebSiteFactory();\r\n            WebSite fx = f.GetWebSiteCategory(\"产品展示\");\r\n            fx.Use();\r\n            WebSite fy = f.GetWebSiteCategory(\"产品展示\");\r\n            fy.Use();\r\n            WebSite fz = f.GetWebSiteCategory(\"产品展示\");\r\n            fz.Use();\r\n            WebSite f1 = f.GetWebSiteCategory(\"博客\");\r\n            f1.Use();\r\n            WebSite f2 = f.GetWebSiteCategory(\"博客\");\r\n            f2.Use();\r\n            Console.WriteLine(\"网站分类总数：{0}\",f.GetWebSiteCount());\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class WebSite {\r\n        public abstract void Use();\r\n    }\r\n    class ConcreteWebSite : WebSite {\r\n        private string name = \"\";\r\n        public ConcreteWebSite(string name) {\r\n            this.name = name;\r\n        }\r\n        public override void Use()\r\n        {\r\n            Console.WriteLine(\"网站分类:\"+name);\r\n        }\r\n    }\r\n    class WebSiteFactory {\r\n        private Hashtable flyweights = new Hashtable();\r\n        public WebSite GetWebSiteCategory(string key) {\r\n            if (!flyweights.ContainsKey(key))\r\n                flyweights.Add(key, new ConcreteWebSite(key));\r\n            return ((WebSite)flyweights[key]);\r\n        }\r\n        public int GetWebSiteCount() {\r\n            return flyweights.Count;\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `example` VALUES ('48', '访问者模式', '访问者模式', 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\nnamespace ConsoleApplication2\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            ObjectStructure o = new ObjectStructure();\r\n            o.Attach(new ConcreteElementA());\r\n            o.Attach(new ConcreteElementB());\r\n            ConcreteVisitor1 v1 = new ConcreteVisitor1();\r\n            ConcreteVisitor2 v2 = new ConcreteVisitor2();\r\n            o.Accept(v1);\r\n            o.Accept(v2);\r\n            Console.Read();\r\n        }\r\n    }\r\n    abstract class Visitor {\r\n        public abstract void VisitConcreteElementA(ConcreteElementA concreteElementA);\r\n        public abstract void VisitConcreteElementB(ConcreteElementB concreteElementB);\r\n    }\r\n    class ConcreteVisitor1 : Visitor {\r\n        public override void VisitConcreteElementA(ConcreteElementA concreteElementA)\r\n        {\r\n            Console.WriteLine(\"{0}被{1}访问\",concreteElementA.GetType().Name,this.GetType().Name);\r\n        }\r\n        public override void VisitConcreteElementB(ConcreteElementB concreteElementB)\r\n        {\r\n            Console.WriteLine(\"{0}被{1}访问\", concreteElementB.GetType().Name, this.GetType().Name);\r\n        }\r\n    }\r\n    class ConcreteVisitor2 : Visitor {\r\n        public override void VisitConcreteElementA(ConcreteElementA concreteElementA)\r\n        {\r\n            Console.WriteLine(\"{0}被{1}访问\", concreteElementA.GetType().Name, this.GetType().Name);\r\n        }\r\n        public override void VisitConcreteElementB(ConcreteElementB concreteElementB)\r\n        {\r\n            Console.WriteLine(\"{0}被{1}访问\", concreteElementB.GetType().Name, this.GetType().Name);\r\n        }\r\n    }\r\n    abstract class Element {\r\n        public abstract void Accept(Visitor visitor);\r\n    }\r\n    class ConcreteElementA : Element {\r\n        public override void Accept(Visitor visitor)\r\n        {\r\n            visitor.VisitConcreteElementA(this);\r\n        }\r\n        public void OperationA() { }\r\n    }\r\n    class ConcreteElementB : Element {\r\n        public override void Accept(Visitor visitor)\r\n        {\r\n            visitor.VisitConcreteElementB(this);\r\n        }\r\n        public void OperationA() { }\r\n    }\r\n    class ObjectStructure {\r\n        private IList<Element> elements = new List<Element>();\r\n        public void Attach(Element element) {\r\n            elements.Add(element);\r\n        }\r\n        public void Detach(Element element) {\r\n            elements.Remove(element);\r\n        }\r\n        public void Accept(Visitor visitor) {\r\n            foreach (Element e in elements) {\r\n                e.Accept(visitor);\r\n            }\r\n        }\r\n    }\r\n}\r\n');
INSERT INTO `moshi` VALUES ('34', '简单工厂模式', '    简单工厂模式属于创建型模式，又叫做静态工厂方法（Static Factory Method）模式。是由一个工厂对象决定创建出哪一种产品类的实例。\r\n    本质：选择实现。\r\n    Simple Factory模式根据提供给它的数据，返回几个可能类中的一个类的实例。通常它返回的类都有一个公共的父类和公共的方法。\r\n    工厂类角色Creator (LightSimpleFactory)：工厂类在客户端的直接控制下（Create方法）创建产品对象。INSERT INTO `moshi` VALUES ('35', '策略模式', '    策略模式（Strategy）：它定义了算法家族，分别封装起来，让他们之间可以相互替换，此模式让算法的变化，不会影响到使用算法的用户。\r\n    策略模式是一种定义一系列算法的方法，从概念上来看，所有这些算法完成的都是相同的工作，只是实现不同，它可以以相同的方式调用所有算法，减少了各种算法类与使用算法类之间的耦合。\r\n    本质：分离算法，选择实现。\r\n    使用策略模式可以把行为和环境分割开来。环境类负责维持和查询行为类，各种算法则在具体策略类（ConcreteStrategy）中提供。\r由于算法和环境独立开来，算法的增减、修改都不会影响环境和客户端。当出现新的促销折扣或现有的折扣政策出现变化时，只需要实现新的策略类，并在客户端登记即可。策略模式相当于\"可插入式（Pluggable）的算法\"。\r\n    策略模式是对算法的包装，是把使用算法的责任和算法本身分割开，委派给不同的对象管理。策略模式通常把一个系列的算法包装到一系列的策略类里面，作为一个抽象策略类的子类。用一句话来说，就是：\"准备一组算法，并将每一个算法封装起来，使得它们可以互换。\" \r     策略模式的Strategy类层次为Context定义了一系列可供重用的算法或行为。继承有助于析取出这些算法中的公共功能。\r\n    这个模式涉及到三个角色：\r环境（Context）角色：持有一个Strategy类的引用（上下文对象），负责和具体的策略类交互。 \r抽象策略（Strategy）角色：这是一个抽象角色，通常由一个接口或抽象类实现。此角色给出所有的具体策略类所需的接口。 \r具体策略（ConcreteStrategy）角色：包装了相关的算法或行为。\r\n    策略模式功能\r把具体算法从具体业务处理中独立\r策略模式与if-else语句\r多个if-else出现考虑使用策略模式\r算法的平等性\r策略算法是形同行为的不同实现\r谁来选择具体策略算法\r客户端\r由上下文来选择具体的策略算法\r\n    应用场景：出现有许多相关的类，仅仅是行为有差别的情况，可以使用策略模式来使用多个行为中的一个来配置一个类的方法，实现算法动态切换 \r出现同一个算法，有很多不同的实现的情况，可以使用策略模式来把这些“不同的实现”实现成为一个算法的类层次 \r需要封装算法中，与算法相关的数据的情况，可以使用策略模式来避免暴露这些跟算法相关的数据结构 \r出现抽象一个定义了很多行为的类，并且是通过多个if-else语句来选择这些行为的情况，可以使用策略模式来代替这些条件语句\r\r。\r\n    优点：策略模式可以避免让客户端涉及到不必要接触到的复杂的和只与算法有关的数据。\r\r避免使用难以维护的多重条件选择语句\r\r更好的扩展\r。\r\n    缺点：上述策略模式，把分支判断又放回到客户端，要改变需求算法时，还是要去更改客户端的程序。 \r客户端必须知道所有的策略类，并自行决定使用哪一个策略类。这就意味着客户端必须理解这些算法的区别，以便适时选择恰当的算法类。\r增加了对象的数目\r只适合扁平的算法结构\r。\r\n    经典案例：1.容错恢复机制\r：应用程序开发中常见的功能\r程序运行的时候，正常情况下应该按某种方式来做，如果按照某种方式来做发生错误的话，系统并不会崩溃，而是继续运行，能提供出错后的备用方案。2.\r日志记录：\r把日志记录到数据库和日志记录到文件当做两种记录日志的策略\r。\r\n    举例：《三国演义》中的故事\r诸葛亮的锦囊妙计（三条妙计\r）：走乔国老的后门，求孙国太放人，请孙夫人退兵。\r赵云按计行事。\r环境角色：赵云，由他来决定选择策略；\r抽象策略角色：(接口)锦囊妙计，按计行事（抽象方法）；\r具体策略角色：三条妙计(单独使用的)。\r', );
INSERT INTO `moshi` VALUES ('36', '装饰模式', '    装饰模式（Decorator）：动态的给一个对象添加一些额外的职责，就增加功能来说，装饰模式比生成子类更为灵活。\r\n    装饰模式常常被称为包裹模式，就是因为每一个具体装饰类都将下一个具体装饰类或者具体构件类包裹起来。装饰模式包含两部分内容，即装饰对象和被装饰对象。\r    Component是定义一个对象接口，可以给这些对象动态的添加职责。ConcreteComponent是定义了一个具体的对象，也可以给这个对象添加一些职责。Decorator，装饰抽象类，继承了Component，从外类来扩展Component类的功能，但对于Component类来说，是无需知道Decorator的存在的。至于ConcreteDecorator就是具体的装饰对象，起到给Component添加职责的功能。装饰模式是利用SetComponent来对对象进行包装的。这样每个装饰对象的实现就和如何使用这个对象分离开来了，每个装饰对象只关心自己的功能，不需要关心如何变添加到对象链中。如果只有一个ConcreteComponent类而没有抽象的Component类，那么Decorator类可以是ConcreteComponent的一个子类。同样道理，如果只有一个ConcreteDecorator类，那么就没有必要建立一个单独的Decorator类，而可以把Decorator和ConcreteDecorator的责任合并成一个类。\r\n    装饰模式是为已有功能动态的添加更多功能的一种方式。\r\n    优点：装饰模式与继承关系的目的都是要扩展对象的功能，但是装饰模式可以提供比继承更多的灵活性。 \r通过使用不同的具体装饰类以及这些装饰类的排列组合，设计师可以创造出很多不同行为的组合。 \r\n    缺点：会产生很多细粒度对象\r\n    装饰模式与策略模式：策略模式改变的是对象的内核\r，装饰模式改变的是对象的外壳\r，策略模式是一层调用\r，装饰模式是递归调用，\r可以有机结合\r。\r\n    装饰模式与AOP：AOP是OOP的延续，是（Aspect Oriented Programming）的缩写，意思是面向方面编程。 \r面向对象开发中，考虑系统的角度通常是纵向的。AOP主要的功能是：日志记录，性能统计，安全控制，事务处理，异常处理等等。\r主要的意图是：将日志记录，性能统计，安全控制，事务处理，异常处理等代码从业务逻辑代码中划分出来，通过对这些行为的分离，我们希望可以将它们独立到非指导业务逻辑的方法中，进而改变这些行为的时候不影响业务逻辑的代码。 \r\r    应用环境：当系统需要新功能的时候，是向旧的类中添加新代码。这些新添加的代码通常装饰了原有类的核心职责或主要行为，他们在主类中加入了新的字段，新的方法，新的逻辑，从而增加了主类的复杂度，这些新加入的东西往往是为了满足某些只在特定情况下才会发生的特殊行为的需要。装饰模式提供了一个非常好的解决方案，它把每个要装饰的功能放在单独的类中，并让这个类包装它所要封装的对象，因此，当需要执行特殊行为时，客户代码就可以在运行时根据需要有选择的，按顺序的使用装饰功能封装对象。', );
INSERT INTO `moshi` VALUES ('37', '代理模式', '    代理模式（Proxy）：为其他对象提供一种代理以控制对象和个对象的访问。\r\n    本质：控制对象访问。\r\n    抽象主题角色（Subject）：声明了真实主题和代理主题的共同接口，这样一来在任何使用真实主题的地方都可以使用代理主题。代理主题（Proxy）角色：代理主题角色内部含有对真实主题的引用，从而可以在任何时候操作真实主题对象；代理主题角色提供一个与真实主题角色相同的接口，以便可以在任何时候都可以替代真实主题；控制真实主题的应用，负责在需要的时候创建真实主题对象（和删除真实主题对象）\r真实主题（RealSubject）角色：定义了代理角色所代表的真实对象\r    优点：（1).职责清晰，真实的角色就是实现实际的业务逻辑，不用关心其他非本职责的事务，通过后期的代理完成一件完成事务，附带的结果就是编程简洁清晰。(2).代理对象可以在客户端和目标对象之间起到中介的作用，这样起到了的作用和保护了目标对象的作用。(3).高扩展性\r\n    举例：以Jive论坛系统为例,访问论坛系统的用户有多种类型:注册普通用户 论坛管理者 系统管理者 游客,注册普通用户才能发言;论坛管理者可以管理他被授权的论坛;系统管理者可以管理所有事务等,这些权限划分和管理是使用Proxy完成的. \r凡是涉及到对论坛修改等事件,其他程序都首先得和ForumProxy打交道,由ForumProxy决定是否有权限做某一样事情,ForumProxy是个名副其实的\"网关\",\"安全代理系统\".\r在平时应用中,无可避免总要涉及到系统的授权或安全体系,不管你有无意识的使用Proxy,实际你已经在使用Proxy了.    应用场景：1、远程代理，也就是为一个对象在不同的地址空间提供局部代表，这样可以隐藏一个对象存在不同地址空间的事实；2、虚拟代理，是根据需要创建开销很大的对象。通过它来存放实例化需要很长时间的真实对象，在必要的时候将被代理的对象加载，当一个模块的加载十分耗费资源时，虚拟代理的优点十分明显；3、安全代理：用来控制真是对象访问时的权限，一般用于对象应该有不同的访问权限的时候；4、智能指引，是指当调用真实的对象时，代理处理另外一些事情；5，copy-on-write代理，虚拟代理的一种；6、cache代理，为昂贵操作提供临时存储空间；、防火墙代理，不让恶意用户接近；8、同步化代理，使几个用户同时访问同一对象而不冲突。', );
INSERT INTO `moshi` VALUES ('38', '工厂方法模式', '    工厂方法模式：是指定义一个接口用于创建对象，但是让子类决定初始化哪个类。工厂方法把一个类的实例化延迟到其子类。\r\n工厂方法（FactoryMethod）模式是类的创建模式，其用意是定义一个创建产品对象的工厂接口，将实际创建工作推迟到子类中。\r在工厂方法模式中，核心的工厂类不再负责所有产品的创建，而是将具体创建工作交给子类去做。这个核心类仅仅负责给出具体工厂必须实现的接口，而不接触哪一个产品类被实例化这种细节。这使得工厂方法模式可以允许系统在不修改工厂角色的情况下引进新产品。工厂方法模式是简单工厂模式的进一步抽象和推广。由于使用了多态性，工厂方法模式保持了简单工厂模式的优点，而且部分克服了它的缺点。工厂方法类的核心是一个抽象工厂类，而简单工厂模式把核心放在一个具体类上。\r工厂方法模式有一个别名叫多态性工厂模式，因为具体工厂类都有共同的接口，或者有共同的抽象父类。       抽象工厂(Creator)角色：是工厂方法模式的核心，与应用程序无关。任何在模式中创建的对象的工厂类必须实现这个接口。\r\n    具体工厂(Concrete Creator)角色：这是实现抽象工厂接口的具体工厂类，包含与应用程序密切相关的逻辑，并且受到应用程序调用以创建产品对象。在上图中有两个这样的角色：BulbCreator与TubeCreator。\r\n    抽象产品(Product)角色：工厂方法模式所创建的对象的超类型，也就是产品对象的共同父类或共同拥有的接口。在上图中，这个角色是Light。\r\n    具体产品(Concrete Product)角色：这个角色实现了抽象产品角色所定义的接口。某具体产品有专门的具体工厂创建，它们之间往往一一对应。\r\n    本质：延迟到子类来选择实现。\r\n    优点：工厂类是整个模式的关键.包含了必要的逻辑判断,根据客户端的选择条件动态实例化相关的类，对于客户端来说，去除了与具体产品的依赖。通过使用工厂类,外界可以从直接创建具体产品对象的尴尬局面摆脱出来,仅仅需要负责“消费”对象就可以了。而不必管这些对象究竟如何创建及如何组织的．明确了各自的职责和权利，有利于整个软件体系结构的优化。 \r\n    缺点：违背了开放--封闭原则\r对工厂类过于依赖\r。在添加新产品时，需要编写新的具体产品类，而且还要 提供与之对应的具体工厂类，系统中类的个数将成对增 加，在一定程度上增加了系统的复杂度，有更多的类需 要编译和运行，会给系统带来一些额外的开销。 由于考虑到系统的可扩展性，需要引入抽象层，在客户 端代码中均使用抽象层进行定义，增加了系统的抽象性 和理解难度，且在实现时可能需要用到DOM、反射等技 术，增加了系统的实现难度。\r\n应用场景：1.当一个类不知道它所必须创建的对象的类的时候。2.当一个类希望由它的子类来指定它所创建的对象的时候。3.将创建对象的职责委托给多个帮助类中的某一个，并且希望将哪一个帮助子类是代理者这一信息局部化的时候。', );
INSERT INTO `moshi` VALUES ('39', '原型模式', '    原型模式：用原型实例指定创建对象的种类，并且通过拷贝这些原型创建新的对象。\r\n其实就是从一个对象创建另一个可定制的对象，而且不需要知道任何创建的细节。\r\n    在C#里面，我们可以很容易的通过Clone()方法实现原型模式。任何类，只要想支持克隆，必须实现C#中的ICloneable接口。ICloneable接口中有一Clone方法，可以在类中复写实现自定义的克隆方法。克隆的实现方法有两种：浅拷贝（shallow copy）与深拷贝（deep copy）。 浅拷贝：只负责克隆按值传递的数据（比如基本数据类型、String类型）\r深拷贝：除了浅拷贝要克隆的值外，还负责克隆引用类型（属性的类型也是对象）的数据。\r需要注意的是执行深拷贝后，原来的对象和新创建的对象不会共享任何东西；改变一个对象对另外一个对象没有任何影响。    本质：克隆生成对象    客户（Client）角色：客户端类向原型管理器提出创建对象的请求。\r\n    抽象原型（Prototype）角色：这是一个抽象角色，通常由一个C#接口或抽象类实现。此角色给出所有的具体原型类所需的接口。在C#中，抽象原型角色通常实现了ICloneable接口。\r\n    具体原型（Concrete Prototype）角色：被复制的对象。此角色需要实现抽象的原型角色所要求的接口。\r\n    原型管理器（Prototype Manager）角色：创建具体原型类的对象，并记录每一个被创建的对象。\r\n    本质：克隆生成对象。\r\n    原型模式与工厂模式：虽然原型引入的初衷是像上面所说，但他实现起来，却完全可以达到工厂模式的效果；而且，用起来甚至比工厂模式更方便、灵活。对于工厂模式与原形模式在功能上的这点巧合，也许是因为本来工厂模式和原型模式都是创建型模式（三种类型，行为、结构），这样，他们的基本功能都能生成对象，因而使得原型模式在功能上可以代替工厂模式。工厂模式实现的生产产品的功能，关键是利用了继承的特性。也就是说，你生成的产品，一定是由同一个抽象产品类派生出来的。所以，在工厂模式下，你如果要生成一类产品，就要引入一个抽像产品类，然后再由它派生出具体产品。\r同样，在原型模式中，你完全可以同样定义一个这样的“抽象产品－－具体产品”层次，再利用具体产品本身的clone功能来产生具体产品本身。从而达到实现工厂模式功能的目的。\r实际上，在原型模式中，每个具体产品就扮演了工厂模式里的具体工厂的角色（因为每个具体产品都具有生成INSERT INTO `moshi` VALUES ('40', '模板方法模式', '    模板方法模式：定义一个操作中的算法的骨架，而将一些步骤延迟到子类中。模板方法使得子类可以不改变一个算法的结构即可重定义该算法的某些特定步骤\r。\r\n    模版方法模式实际上是所有模式中最为常见的几个模式之一，而且很多人可能使用过模版方法模式而没有意识到自己已经使用了这个模式。模版方法模式是基于继承的代码复用的基本技术，模版方法模式的结构和用法也是面向对象设计的核心。\r\n    模版方法模式需要开发抽象类和具体子类的设计师之间的协作。一个设计师负责给出一个算法的轮廓和骨架，另一些设计师则负责给出这个算法的各个逻辑步骤。代表这些具体逻辑步骤的方法称做基本方法（primitive method）；而将这些基本方法总汇起来的方法叫做模版方法（template method），这个设计模式的名字就是从此而来。\r\n    抽象模版（AbstractClass）角色有如下的责任：\r定义了一个或多个抽象操作，以便让子类实现。这些抽象操作叫做基本操作，它们是一个顶级逻辑的组成步骤。\r定义并实现了一个模版方法。这个模版方法一般是一个具体方法，它给出了一个顶级逻辑的骨架，而逻辑的组成步骤在相应的抽象操作中，推迟到子类实现。顶级逻辑也有可能调用一些具体方法。具体模版（ConcreteClass）角色有如下的责任：\r实现父类所定义的一个或多个抽象方法，它们是一个顶级逻辑的组成步骤。\r每一个抽象模版角色都可以有任意多个具体模版角色与之对应，而每一个具体模版角色都可以给出这些抽象方法（也就是顶级逻辑的组成步骤）的不同实现，从而使得顶级逻辑的实现各不相同。\r\n    优点\r：实现代码复用\r。\r\n    缺点：\r算法骨架不容易升级（模板和子类是非常耦合的，如要对模板中的算法骨架进行变更，会影响子类变化）\r。 \r  \r    应用场景：当我们要完成在某一细节层次一致的一个过程或一系列步骤，但其个别步骤在更详细的层次上的实现可能不同的时候，我们通常要考虑用模板方法模式解决。\r', );
INSERT INTO `moshi` VALUES ('41', '外观模式', '    外观模式：为子系统中的一组接口提供一个一致的界面，此模式定义了一个高层接口，这个接口使得这一子系统更加容易使用。\r\n    本质：封装交互、简化调用     外观(Facade)角色：客户端可以调用这个角色的方法。此角色知晓相关的(一个或者多个)子系统的功能和责任。在正常情况下，本角色会将所有从客户端发来的请求委派到相应的子系统去。\r\r子系统(subsystem)角色：可以同时有一个或者多个子系统。每一个子系统都不是一个单独的类，而是一个类的集合。每一个子系统都可以被客户端直接调用，或者被门面角色调用。子系统并不知道门面的存在，对于子系统而言，门面仅仅是另外一个客户端而已。     【GOF】的书中指出：在外观模式中，通常只需要一个外观类，并且此外观类只有一个实例，换言之它是一个单例类。当然这并不意味着在整个系统里只能有一个外观类，而仅仅是说对每一个子系统只有一个外观类。或者说，如果一个系统有好几个子系统的话，每一个子系统有一个外观类，整个系统可以有数个外观类。 \r\n    优点：屏蔽了外部客户端和系统内部模块的交互\rFacade的功能可以被多个客户端调用，可以实现复用（功能的共享）\r对使用Facade的人员来说，Facade大大的节省了他们的学习成本\r\r    应用场景：为一个复杂子系统提供一个简单接口时：子系统往往因为不断演化而变得越来越复杂。大多数模式使用时都会产生更多更小的类。这使得子系统更具可重用性，也更容易对子系统进行定制，但这也给那些不需要定制子系统的用户带来一些使用上的困难。 Facade可以提供一个简单的缺省视图，这一视图对大多数用户来说已经足够，而那些需要更多的可定制性的用户可以越过Facade层。INSERT INTO `moshi` VALUES ('42', '建造者模式', '    建造者模式：将一个复杂对象的构建与它的表示分离，使得同样的构建过程可以创建不同的表示。\r\n    本质：分离整体构建算法和部件构造。\r\n    建造者（Builder）角色：定义创建一个Product对象所需的各个部件的操作\r。具体建造者（Concrete Builder）角色：\r实现Builder角色提供的接口，一步一步完成创建产品实例的过程。 \r在建造过程完成后，提供产品的实例。指导者（Director）角色：主要用来使用Builder接口，以一个统一的过程来构建所需要的Product对象\r产品（Product）角色：产品便是建造中的复杂对象。\r指导者角色是与客户端打交道的角色。指导者角色将客户端创建产品的请求划分为对各个零件的建造请求，再将这些请求委派给具体建造者角色。具体建造者角色是做具体建造工作的，但却不为客户端所知。\r客户端负责创建指导者和具体建造者对象。然后，客户把具体建造者对象交给指导者。客户一声令下，指导者操纵建造者开始创建产品。当产品创建完成后，建造者把产品返还给客户端。\r\n    优点：建造者模式的使用使得产品的内部表象可以独立的变化。使用建造者模式可以使客户端不必知道产品内部组成的细节。 \r每一个Builder都相对独立，而与其它的Builder无关。 \r模式所建造的最终产品更易于控制。\r\n    应用场景：需要生成的产品对象有复杂的内部结构。 \r需要生成的产品对象的属性相互依赖，建造者模式可以强迫生成顺序。 \r?在对象创建过程中会使用到系统中的一些其它对象，这些对象在产品对象的创建过程中不易得到。 ', );
INSERT INTO `moshi` VALUES ('43', '观察者模式', '    观察者模式:定义了一种一对多的依赖关系，让多个观察者对象同时监听某一个主题对象。这个主题对象在状态上发生变化时，会通知所有观察者对象，使它们能够自动更新自己。\r\n    本质：触发联动\r\n\r    观察者模式又叫做:\r发布-订阅（Publish/Subscribe）模式\r模型-视图（Model/View）模式\r源-监听器（Source/Listener）模式\r从属者（Dependents）模式。    抽象主题（Subject）角色：\r一个目标可以被多个观察者观察\r目标提供对观察者注册和退订的维护\r当目标的状态发生变化时，目标负责通知所有注册的、有效地观察者\r。抽象观察者（Observer）角色：为所有的具体观察者定义一个接口，在得到主题的通知时更新自己。这个接口叫做更新接口。抽象观察者角色一般用一个抽象类或者一个接口实现。在这个示意性的实现中，更新接口只包含一个方法（即Update()方法），这个方法叫做更新方法。 具体主题（ConcreteSubject）角色：将有关状态存入具体现察者对象；在具体主题的内部状态改变时，给所有登记过的观察者发出通知。具体主题角色又叫做具体被观察者角色（Concrete Observable）。具体主题角色通常用一个具体子类实现。具体观察者（ConcreteObserver）角色：具体现察者角色实现抽象观察者角色所要求的更新接口，以便使本身的状态与主题的状态相协调。如果需要，具体现察者角色可以保存一个指向具体主题对象的引用。具体观察者角色通常用一个具体子类实现。 \r\n    认识观察模式：目标和观察者之间的关系\r典型的一对多的关系\r单向依赖\r观察者依赖于目标\r触发通知的时机\r完成了状态维护后触发\r相互观察\rA、B观察C，B、C观察A（两套观察模式）\r注意死循环\r通知的顺序\r绝对不要依赖于通知的顺序，多个观察者之间的功能是平行的，相互不应该有先后的依赖关系\r。\r\n    在C#中实现Observer模式没有这么辛苦，.NET中提供了Delegate与Event机制，我们可以利用这种机制简化Observer模式\r\n     优点：观察者模式实现了观察者和目标之间的抽象耦合。\r观察者模式实现了动态联动\r观察者模式支持广播通信。被观察者会向所有的登记过的观察者发出通知。\r\n     缺点：可能会引起无谓的操作。\r由于采用广播方式，不管观察者需不需要，每个观察者都会被调用update方法\r。', );
INSERT INTO `moshi` VALUES ('44', '抽象工厂模式', '    定义：提供一个创建一系列相关或相互依赖对象的接口，而无需指定他们具体的类。\r\n    本质：选择产品簇的实现\r。    \r\n    抽象工厂模式是所有形态的工厂模式中最为抽象和最具一般性的一种形态。\r\n    为了方便引入抽象工厂模式，引进一个新概念：产品族（Product Family）。所谓产品族，是指位于不同产品等级结构，功能相关联的产品组成的家族。\r\n    所谓的抽象工厂是指一个工厂等级结构可以创建出分属于不同产品等级结构的一个产品族中的所有对象。\r\n    抽象工厂（Abstract Factory）角色：担任这个角色的是工厂方法模式的核心，它是与应用系统商业逻辑无关的。 \r具体工厂（Concrete Factory）角色：这个角色直接在客户端的调用下创建产品的实例。这个角色含有选择合适的产品对象的逻辑，而这个逻辑是与应用系统的商业逻辑紧密相关的。\r抽象产品（Abstract Product）角色：担任这个角色的类是工厂方法模式所创建的对象的父类，或它们共同拥有的接口。\r具体产品（Concrete Product）角色：抽象工厂模式所创建的任何产品对象都是某一个具体产品类的实例。这是客户端最终需要的东西，其内部一定充满了应用系统的商业逻辑。 \r\n    抽象工厂与工厂模式：AbstractFactory模式是为创建一组（有多类）相关或依赖的对象提供创建接口。\r\rFactory模式是为一类对象提供创建接口\r。\r\n    优缺点（从开放-封闭原则）：“开放－封闭”原则要求系统对扩展开放，对修改封闭。通过扩展达到增强其功能的目的。对于涉及到多个产品族与多个产品等级结构的系统，其功能增加包括两方面：\r增加产品族：Abstract Factory很好的支持了\"开放－封闭\"原则。\r增加新产品的等级结构：需要修改所有的工厂角色，没有很好支持“开放－封闭”原则。\r分离接口和实现，使得客户端从具体的产品实例中解耦\r综合起来，抽象工厂模式以一种倾斜的方式支持增加新的产品，它为新产品族的增加提供方便，而不能为新的产品等级结构的增加提供这样的方便。 \r    应用场景：希望一个系统不应当依赖于产品类实例如何被创建、组合和表达的细节 时。\r一个系统有多于一个的产品族，而系统只消费其中某一产品族\r。\r\n    补充：依赖注入(Dependency Injection)和控制反转(Inversion of Control)是同一个概念。具体含义是:\r当某个角色需要另一个角色的协助时，在传统的程序设计过程中，通常由调用者来创建被调用者的实例。但在“依赖注入”里，创建被调用者的工作不再由调用者来完成，因此称为控制反转;创建被调用者 实例的工作通常由Ioc容器来完成，然后注入调用者，因此也称为依赖注入。\r\nUsing System.\r\nReflection\r\rAssembly.Load(“程序集名称”).CreateInstance(“命名空间.类名称”)\r', );
INSERT INTO `moshi` VALUES ('45', '状态模式', '    定义：允许一个对象在其内部状态改变时改变它的行为，这个对象看起来似乎修改了它的类。\r\n    本质：根据状态来分离和选择行为。\r状态模式是状态驱动，由上下文负责    状态模式主要解决的是当控制一个对象状态转换的条件表达式过于复杂时的情况。把状态的判断逻辑转移到表示不同状态的一系列类当中，可以把复杂的逻辑简化。\r\n    在State模式中我们将状态逻辑和动作实现进行分离。当一个操作中要维护大量的分支语句，并且这些分支依赖于对象的状态。State模式将每一个分支都封装到独立的类中。\r\n    优点：将与特定状态相关的行为局部化，并且将不同状态的行为分割开来\r消除庞大的条件分支语句，把各种状态转移逻辑分布到State的子类之间，减少了相互间的依赖。\r显式化进行状态转换：为不同的状态引入独立的对象，使得状态的转换变得更加明确。而且状态对象可以保证上下文不会发生内部状态不一致的状况，因为上下文中只有一个变量来记录状态对象，只要为这一个变量赋值就可以了。\r\n    缺点：State模式问题主要是逻辑分散化，状态逻辑分布到了很多的State的子类中，很难看到整个的状态逻辑图，这也带来了代码的维护问题。    状态模式与策略模式比较：State模式和Strategy模式有很大程度上的相似：它们都有一个Context类，都是通过委托（组合）给一个具有多个派生类的多态基类实现Context的算法逻辑\r两者最大的差别就是State模式中派生类持有指向Context对象的引用，并通过这个引用调用Context中的方法，但在Strategy模式中就没有这种情况。\r\n    举例：1.在线投票\r：同一个用户只能投一票\r如果一个用户反复投票，而且投票次数超过5次，判定为恶意投票，要取消该用户的投票资格，并取消他所投的票\r若超过8次，将进入黑名单，禁止再登录和使用系统。2.\r工作流中的请假流程：\r某人提出请假申请，先由项目经理审批，如果项目经理不同意，审批就直接结束\r如项目经理同意，再看是否超过3天，如果三天以内，审批直接结束\r否则，交给部门经理，部门经理审核后，无论是否同意，审批直接结束\r', );
INSERT INTO `moshi` VALUES ('46', '适配器模式', '    适配器模式把一个类的接口变换成客户端所期待的另一种接口，从而使原本接口不匹配而无法在一起工作的两个类能够在一起工作。\r\n    本质：转换匹配，复用功能    实际上在软件系统设计和开发中，这种问题也会经常遇到：我们为了完成某项工作购买了一个第三方的库来加快开发。这就带来了一个问题：我们在应用程序中已经设计好了接口，与这个第三方提供的接口不一致，为了使得这些接口不兼容的类（不能在一起工作）可以在一起工作，Adapter模式提供了将一个类（第三方库）的接口转化为客户（购买使用者）希望的接口。    适配器的两种形式：类的适配器模式\r对象的适配器模式\r\r主要讲解对象的适配器模式 \r。\r\n    客户端需要调用Request方法，而Adaptee没有该方法，为了使客户端能够使用Adaptee类，需要提供一个包装（Wrapper）类Adapter。这个包装类包装了一个Adaptee的实例，从而将客户端与Adaptee衔接起来。由于Adapter与Adaptee是委派（组合）关系，这决定了这个适配器模式是对象的。\r目标（Target）角色：这是客户所期待的接口。目标可以是具体的或抽象的类，也可以是接口。\r\r源（Adaptee）角色：需要适配的类。适配器（Adapter）角色：通过在内部包装（Wrap）一个Adaptee对象，把源接口转换成目标接口。    Adapter模式主要应用于“希望复用一些现存的类，但是接口又与复用环境要求不一致的情况”，在遗留代码复用、类库迁移等方面非常有用。\rAdapter模式有对象适配器和类适配器两种形式的实现结构，但是类适配器采用“多继承”的实现方式，带来了不良的高耦合，所以一般不推荐使用。对象适配器采用“对象组合”的方式，更符合松耦合精神。    应用场景：系统需要使用现有的类，而此类的接口不符合系统的需要。\r想要建立一个可以重复使用的类，该类可能与其它不相关的类或不可预见的类（即那些接口可能不一定兼容的类）协同工作。\r（对对象适配器而言）在设计里，你想使用一些已经存在的子类，但是不可能对每一个子类都进行适配。对象适配器可以适配它们的父类接口。    优点：\r更好的复用性\r更好的可扩展性\r在实现适配器功能的时候，可以调用自己开发的功能，从而自然地扩展系统的功能\r。\r\n    缺点：\r过多地使用适配器，会让系统非常凌乱，不容易整体进行把握。\r', );
INSERT INTO `moshi` VALUES ('47', '备忘录模式', '    定义：在不破坏封装性的前提下，捕获一个对象的内部状态，并在该对象之外保存这个状态。\r\n    本质：保存和恢复内部状态。\r\n    优点：有时一些发起人对象的内部信息必须保存在发起人对象以外的地方，但是必须要由发起人对象自己读取，这时，使用备忘录模式可以把复杂的发起人内部信息对其他的对象屏蔽起来，从而可以恰当地保持封装的边界。\r本模式简化了发起人类。发起人不再需要管理和保存其内部状态的一个个版本，客户端可以自行管理他们所需要的这些状态的版本。\r当发起人角色的状态改变的时候，有可能这个状态无效，这时候就可以使用暂时存储起来的备忘录将状态复原。\r\n    缺点：\r如果发起人角色的状态需要完整地存储到备忘录对象中，那么在资源消耗上面备忘录对象会很大。\r当负责人角色将一个备忘录 存储起来的时候，负责人可能并不知道这个状态会占用多大的存储空间，从而无法提醒用户一个操作是否很大。\r\n     适用场合：\r如果必须保存一个对象在某一个时刻的全部或者部分状态，方便在以后需要的时侯，可以把该对象恢复到先前的状态，可以使用备忘录模式\r。', );
INSERT INTO `moshi` VALUES ('48', '组合模式', '    组合模式有时又叫做部分－整体模式（Part-Whole）。组合模式将对象组织到树结构中，可以用来描述整体与部分的关系。组合模式可以使客户端将单纯元素与复合元素同等看待。\r\n    本质：统一叶子对象和组合对象\r。\r\n    对象的树结构：一个树结构由两种节点组成：树枝节点和树叶节点。树枝节点可以有子节点，而一个树叶节点不可以有子节点。除了根节点外，其它节点有且只有一个父节点。    抽象构件（Component）角色：这是一个抽象角色，它给参与组合的对象规定一个接口。这个角色给出共有接口及其默认行为。\r树叶构件（Leaf）角色：代表参加组合的树叶对象。一个树叶对象没有下级子对象。 \r树枝构件（Composite）角色：代表参加组合的有子对象的对象，并给出树枝构件对象的行为。\r\n    组合模式的目的\r让客户端不再区分操作的是组合对象还是叶子对象，而是以一种统一的方式来操作\r。\r\n    对象树：\r组合模式会组合出树形结构来，这也就意味着，所有可以使用对象树来描述或操作的功能，都可以考虑使用组合模式。比如读取XML文件，或是对语句进行语法分析等\r。\r\n    组合模式的实现根据所实现接口的区别分为两种形式，分别称为安全模式和透明模式。组合模式可以不提供父对象的管理方法，但组合模式必须在合适的地方提供子对象的管理方法（诸如：add、remove、Display等）。\r\n    透明方式：在Component里面声明所有的用来管理子类对象的方法，包括add（）、remove（），以及Display（）方法。\r\n    优点：所有的构件类都有相同的接口。在客户端看来，树叶类对象与组合类对象的区别起码在接口层次上消失了，客户端可以同等的对待所有的对象。这就是透明形式的组合模式。\r\n    缺点：不够安全，因为树叶类对象和合成类对象在本质上是有区别的。树叶类对象不可能有下一个层次的对象，因此add（）、remove（）以及Display（）方法没有意义，是在编译时期不会出错，而只会在运行时期才会出错。\r\n    安全方式：在Composite类里面声明所有的用来管理子类对象的方法 。\r\n    \r优点：这样的做法是安全的做法 ，树叶类型的对象根本就没有管理子类对象的方法，因此，如果客户端对树叶类对象使用这些方法时，程序会在编译时期出错。\r\n    \r缺点 ：不够透明，树叶类和合成类将具有不同的接口  \r\r \r\n    举例：在绘图编辑器和图形捕捉系统这样的图形应用程序中，用户可以使用简单的组件创建复杂的图表。用户可以组合多个简单组件以形成一些较大的组件，这些组件又可以组合成更大的组件。\r一个简单的实现方法是为Text和Line这样的图元定义一些类，另外定义一些类作为这些图元的容器类(Container)。INSERT INTO `moshi` VALUES ('49', '迭代器模式', '    迭代器模式：提供一种方法顺序访问一个聚合对象中各个元素，而又不暴露该对象的内部表示。最简单的：\r.Net中的 foreach in\rJava中的for(Leaf leaf:childLeaf){…}    应用场景：1.当你需要访问一个聚集对象，而且不管这些对象是什么都需要遍历的时候；2.需要对聚集有多种遍历方式时；3.为遍历不同的聚集结构提供如开始，下一个，是否结束，当前哪一项等统一的接口。\r\n    迭代器模式就是为了分离集合对象的遍历行为，抽象出一个迭代器类来负责，这样既可以做到不暴露集合的内部结构，又可以让外部代码透明的访问集合内部的数据。', );
INSERT INTO `moshi` VALUES ('50', '单例模式', '    Singleton模式是设计模式中最为简单、最为常见、最容易实现，也是最应该熟悉和掌握的模式。\r公司企业在招聘的时候为了考察员工对设计的了解和把握，考的最多的就是Singleton模式。\r\n    本质：控制实例数目\r。\r\n    Singleton模式解决问题十分常见，我们怎样去创建一个唯一的变量（对象）\r保证一个类仅有一个实例，并提供一个访问它的全局访问点。\r例如：打印机\r \r。\r\n    Singleton模式包含的角色只有一个，就是Singleton。Singleton拥有一个私有构造函数，确保用户无法通过new直接实例它。除此之外，该模式中包含一个静态私有成员变量instance与静态公有方法GetInstance。GetInstance方法负责检验并实例化自己，然后存储在静态成员变量中，以确保只有一个实例被创建。     单例类只能有一个实例。\r\r单例类必须自己创建自己的唯一实例。 \r\r单例类必须给所有其它对象提供这一实例。\r    单例模式的实现又分为两种：\r懒汉式单例模式（时间换空间）\r饿汉式单例模式（空间换时间）\r。\r\n    使用Singleton模式有一个必要条件：在一个系统要求一个类只有一个实例时才应当使用单例模式。反过来，如果一个类可以有几个实例共存，就不要使用单例模式。\r', );
INSERT INTO `moshi` VALUES ('51', '桥接模式', '    定义：将抽象部分与它的实现部分分离，是他们都可以独立的变化。（实现指的是抽象类和它的派生类用来实现自己的对象）\r\n    实现系统可能有多种角度分类，每一种分类都有可能变化，那么就把这种多角度分离出来让它们独立变化，减少他们之间的耦合。\r\n    本质：分离抽象和实现。\r\n    桥接是单向的，抽象部分的对象使用具体实现的对象而不能反过来。', );
INSERT INTO `moshi` VALUES ('52', '命令模式', '    定义：将一个请求封装为一个对象，从而使你可用不同的请求对客户进行参数化，对请求排队或记录请求日志，以及支持可撤销的操作。\r\n    本质：封装交互。\r\n    命令模式把发出命令的责任和执行命令的责任分开，允许请求的一方和接收的一方独立开来。可和备忘录模式结合使用（做撤销）。\r\n    优点：第一，它能较容易的设计一个命令队列；第二，在需要的情况下，可以较容易的将命令记入日志；第三，允许请求的一方决定是否要否决请求；第四，可以容易的实现队请求的撤销和重做；第五，由于加进新的具体命令类不影响其他的类，因此增加其他的具体命令类很容易；第六，命令模式把请求一个操作的对象与知道怎么执行一个操作的对象分隔开。\r\n    敏捷开发原则告诉我们，不要为代码添加基于猜测的、实际不需要的功能。如果不清楚一个系统是否需要命令模式，一般就不要着急去实现它，事实上，在需要的时候通过重构实现这个模式并不困难，只有在真正需要如撤销/恢复操作等功能时，把原来的代码重构为命令模式才有意义。', );
INSERT INTO `moshi` VALUES ('53', '职责链模式', '    定义：使多个对象都有机会处理请求，从而避免请求的发送者和接收者之间的耦合关系。将这个对象连成一条链，并沿着这条链传递该请求，直到有一个对象处理它为止。\r\n    本质：分离职责，动态组合。\r\n    ConcreteHandler类，具体处理者处理他所负责的请求，可访问它的后继者，如果可处理该请求，就处理之，否则就将该请求转发给它的后继者。\r\n    ConcreteHandler1，当请求数在0到10之间则有权处理，否则转到下一位。\r\n    ConcreteHandler2，当请求数在10到20之间则有权处理，否则转到下一位。\r\n    ConcreteHandler3，当请求数在20到30之间则有权处理，否则转到下一位。\r\n    好处：当客户提交一个请求时，请求是沿链传递直到有一个ConcreteHandler对象负责处理它。。接受者和执行者都没有对方的明确信息，且链中的对象自己并不知道链的结构。结果是职责链可简化对象的相互连接，他们仅需保持一个指向后继者的引用，而不需保持它所有的候选接收者的引用，大大降低了耦合度。随时增加或修改处理一个请求的结构。增强了给对象指派职责的灵活性。一个请求也可能到了链的末端都得不到处理，或者因为没有正确配置而得不到处理，这就很糟糕，需要事先考虑全面。', );
INSERT INTO `moshi` VALUES ('54', '中介者模式', '    定义：用一个中介对象来封装一系列的对象交互。中介者模式使个对象不需要显示的相互引用，从而使其耦合松散，而且可以独立的改变他们之间的交互。\r\n    本质：封装交互。\r\n    Colleague叫做抽象同事类，而ConcreteColleague是具体同事类，每个具体同事只知道自己的行为，而不了解其他同事类的情况，但他们却都认识中介者对象，Mediator是抽象中介者，定义了同事对象到中介者对象的接口，ConcreteMediator是具体中介者对象，实现抽象类的方法，他需要知道所有具体同事类，并从具体同事类接收消息，向具体同事对象发出命令。\r\n    中介者模式很容易在系统中应用，也很容易在系统中误用。当系统中出现了“多对多”交互复杂的对象群时，不要急于使用中介者模式，二是先反思你的系统在设计上是不是合理。Mediator的出现减少了各个Colleague的耦合，使得可以独立的改变和复用各个Colleague类和Mediator，由于把对象如何协作进行了抽象，将中介作为一个独立的概念并将其封装在一个对象中，这样关注的对象就从对象各自本身的行为转移到他们之间的交互上来，也就是站在一个更宏观的角度去看待系统。由于ConcreteMediator控制了集中化，于是就把交互复杂性变为了中介者的复杂性，这就使得中介者会变得任何一个ConcreteColleague都复杂。\r\n    中介者模式一般应用于一组对象以定义良好但是复杂的方式进行通信的场合，以及想定制一个分布在多个类中的行为，而又不想生成太多的子类的场合。', );
INSERT INTO `moshi` VALUES ('55', '享元模式', '    定义：运用共享技术有效的支持大量细粒度的对象。\r\n    FlyWeight类：它是所有具体享元类的超类或接口，通过这个接口，FlyWeight可以接受并作用于外部状态。ConcreteFlyWeight是继承FlyWeight超类或实现FlyWeight接口，并未内部状态增加存储空间。\r\n    UnsharedConcreteFlyWeight是指呢些不需要共享的FlyWeight子类。因为FlyWeight接口共享成为可能，但他并不强制共享。FlyWeightFactory，是一个享元工厂，用来创建并管理FlyWeight对象。它主要是用来确保合理的共享FlyWeight，当用户请求一个FlyWeight时，FlyWeightFactory对象提供一个已经创建的实例或者创建一个（如果不存在的话）。\r\n    享元模式可以避免大量非常相类似的开销。在程序设计中，有时需要生成大量细粒度的类实例来表示数据。如果能发现这些实例除了几个参数外基本上都是相同的，有时就能够受大幅度的减少需要实例化的类的数量。如果能把呢些参数移到类实例外面，在方法调用时将他们传进来，就可以通过共享大幅度的减少单个实例的数目。\r\n    缺点：逻辑复杂化，运行时间变长。\r\n    应用场景：如果一个应用程序使用了大量的对象，而大量的这些对象造成了很大的存储开销是就用；还有就是对象的大多数状态可以外部状态，如果删除对象的外部状态，呢么可以用相对较少的共享对象取代很多组对象，此时可以考虑使用享元模式。\r\n', );
INSERT INTO `moshi` VALUES ('56', '访问者模式', '    定义：表示一个作用于某对象结构中的各个元素的操作。它使你可以在不改变各元素的类的前提下定义作用于这些元素的新操作。\r\n    本质：预留通路，回调实现。\r\n    访问者模式适用于数据结构相对稳定的系统。他把数据结构和作用于数据结构之间的耦合解脱开，使得操作集合可以相对自由的演化。\r\n    访问者模式的目的是要把处理从数据结构分离出来。有比较稳定的数据结构，又有益于变化的算法的话，使用访问者模式是比较合适的，因为访问者模式就是比较合适的，因为访问者模式使得算法操作的增加变得容易。\r\n    访问者模式的优点就是增加新的操作容易，因为增加新的操作就意味着增加一个新的访问者，访问者模式将有关的行为集中到一个访问者对象中。\r\n    缺点：使增加新的数据结构变得困难了。', );
