\r当客户程序与抽象类的实现部分之间存在着很大的依赖性时，引入Facade将这个子系统与客户以及其他的子系统分离，可以提高子系统的独立性和可移植性。 \r\r在层次化结构中，可以使用Facade模式定义系统中每一层的入口点，如果子系统之间是相互依赖的，则可以让他们仅通过Facade进行通信，从而简化他们之间的依赖关系。\r希望包装或隐藏原有系统：Facade可以把原有系统作为自己的私有成员。原有系统与Facade类联系在一起，但使用Facade类的客户无法看到原有的系统。\r维护一个遗留的大型系统。\r跟踪对系统的使用---强迫所有客户通过Facade使用原有系统。\r', );
